INSERT INTO `sanpham` (`id`, `ten`, `gia`, `thuonghieu_id`, `gioithieu`, `sanxuat`, `docao`, `mota`, `giamgia`, `created_at`, `updated_at`) VALUES
(1, 'GIÀY RACER TR23', 1800999.00, 4, 'Giày thể thao \"RACER TR23\" một loại giày thể thao được thiết kế để đua và tập luyện siêu thoải mái. \r\n\r\nDòng giày này với chất liệu nhẹ, đế linh hoạt và lớp lưới phía trên thoáng khí để thông gió và hỗ trợ tối ưu. \r\n\r\nThiết kế mang lại cảm giác vừa vặn thoải mái và ổn định trong các hoạt động cường độ cao như chạy, đạp xe và các môn thể thao khác.\r\n\r\nKiểu dáng đẹp, thể thao và cực kỳ thoải mái. \r\n\r\nBạn có thể kết hợp hoàn hảo với quần jean, váy và hầu hết mọi thứ khác trong tủ quần áo của bạn, những đôi giày thể thao adidas này sẽ luôn xoay chuyển liên tục. Phần trên êm ái được lót để mang lại sự mềm mại, trong khi lớp đệm Cloudfoam mang lại tất cả sự hỗ trợ bạn cần trong những ngày bạn phải chạy khắp nơi.\r\n\r\nĐược làm bằng nhiều loại vật liệu tái chế, phần trên này có hàm lượng tái chế ít nhất 50%.', 'Việt Nam', 5.00, 'Kiểu dáng: Regular fit (ôm vừa, thoải mái).\r\n\r\n♦ Cách cài giày: thắt dây (Lace closure).\r\n\r\n♦ Phần trên giày được làm từ chất liệu lưới vải thoáng khí.\r\n\r\n♦ Lót vải (Textile lining).\r\n\r\n♦ Đế giữa cloundform thoải mái\r\n\r\n♦ Đế giày làm từ cao su (Rubber outsole).\r\n\r\n♦ Phần trên giày chứa ít nhất 50% chất liệu tái chế (Upper contains a minimum of 50% recycled content).', 10, '2024-05-06 14:35:14', '2024-05-14 02:41:19'),
(2, 'GIÀY ULTRABOUNCE', 1999000.00, 4, 'Đôi giày adidas này giúp bạn sải bước tiếp theo trên hành trình chạy bộ. Đệm Bounce siêu nhẹ mang đến cảm giác thoải mái và linh hoạt để trợ lực cho bạn khi tăng cường cự ly trên đường chạy hàng ngày. Đế ngoài bằng cao su bền bỉ đảm bảo độ bám trên nhiều bề mặt đa dạng để bạn tự tin sải bước.', 'Canada', 9.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải dệt\r\nĐế giữa Bounce\r\nLớp lót bằng vải dệt', 10, '2024-05-06 14:35:46', '2024-05-14 02:37:14'),
(3, 'GIÀY CHẠY BỘ EQ21', 2300000.00, 1, 'Tự tin chinh phục cự ly với đôi giày chạy bộ adidas này. Thân giày thoáng khí giúp đôi chân bạn luôn khô thoáng khi chạy đường dài. Lớp đệm siêu nhẹ cho sải bước đàn hồi dễ chịu từ lúc xuất phát tới tận khi về đích.', 'Mỹ', 10.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải lưới kỹ thuật\r\nĐệm cổ chân\r\nPhần quarter và kẹp ổn định gót bằng TPU\r\nĐế giữa Bounce', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(4, 'GIÀY ULTRABOOST 1.0', 500000.00, 4, 'Khi đi dạo trong công viên cũng như chạy bộ cuối tuần cùng bạn bè, đôi giày adidas Ultraboost 1.0 này sẽ giúp bạn luôn thoải mái. Thân giày adidas PRIMEKNIT ôm chân nhẹ nhàng, cùng đệm BOOST ở đế giữa nâng niu từ bước chân đầu tiên cho tới tận cây số cuối cùng.', 'Việt Nam', 3.00, 'Có dây giày\r\nThân giày bằng vải dệt adidas PRIMEKNIT\r\nĐệm gót giày đúc Fitcounter\r\nĐế giữa BOOST', 10, '2024-05-06 14:35:46', '2024-05-19 23:04:54'),
(5, 'GIÀY SAMBA OG', 999999.00, 1, 'Ra đời trên sân bóng, giày Samba là biểu tượng kinh điển của phong cách đường phố. Phiên bản này trung thành với di sản, thể hiện qua thân giày bằng da mềm, dáng thấp, nhã nhặn, các chi tiết phủ ngoài bằng da lộn và đế gum, biến đôi giày trở thành item không thể thiếu trong tủ đồ của tất cả mọi người - cả trong và ngoài sân cỏ.', 'Canada', 2.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng da cật với các chi tiết da lộn bụi bặm và nhũ vàng ánh kim\r\nLớp lót bằng da tổng hợp; Đế gum bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(6, 'GIÀY STAN SMITH', 2500000.00, 1, 'Vẻ đẹp kinh điển. Phong cách vốn dĩ. Đa năng hàng ngày. Suốt hơn 50 năm qua và chưa dừng ở đó, giày adidas Stan Smith luôn giữ vững vị trí là một biểu tượng. Đôi giày này là phiên bản cải biên mới mẻ, là một phần cam kết của adidas hướng tới chỉ sử dụng polyester tái chế bắt đầu từ năm 2024. Với thân giày vegan và đế ngoài làm từ cao su phế liệu, đôi giày này vẫn mang phong cách đầy tính biểu tượng, đồng thời thân thiện với môi trường.', 'Việt Nam', 3.00, 'Dáng regular fit\r\nCó dây giày\r\nLớp lót bằng chất liệu tổng hợp\r\nĐế ngoài bằng cao su\r\nVegan', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(7, 'GIÀY CHẠY BỘ RUN 70S LIFESTYLE', 1800000.00, 1, 'Tôn vinh thập niên 70 với đôi giày chạy bộ adidas này và ăn mừng thời kỳ mở đường cho thú cưng đá và sợi polyester và những chiếc thảm dày đến mức bạn có thể chìm vào trong đó. Thân giày bằng da này tái hiện thiết kế nhiều dây của những mẫu giày chạy bộ kinh điển cho bạn tấm vé trở về \"tuổi thơ\", mà không cần phải biết nhảy disco.', 'Đức', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải dệt và da lộn\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su\r\nThân giày có chứa tối thiểu 50% thành phần tái chế', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(8, 'GIÀY ALPHABOOST V1', 3599999.00, 4, 'Nâng tầm phong cách cuối tuần của bạn với đôi giày adidas Alphaboost này. Hãy mang giày và xuống phố. Đế giữa Bounce cho sải bước êm ái và đàn hồi. Đệm BOOST ở gót giày hoàn trả năng lượng trên từng sải bước, cho bạn sải bước nhẹ tênh suốt buổi chiều.', 'Anh', 9.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải lưới\r\nLớp đệm Adiprene+\r\nĐế giữa kết hợp đệm BOOST và Bounce\r\nĐế ngoài Adiwear\r\nThân giày có chứa tối thiểu 50% thành phần tái chế', 10, '2024-05-06 14:35:46', '2024-05-14 02:37:28'),
(9, 'GIÀY ADIFOM CLIMACOOL', 2699999.00, 4, 'Khi kết hợp hài hòa giữa phong cách và hiệu năng, bạn sẽ có được đôi giày adidas này. Với thiết kế giúp bạn luôn mát mẻ và thoải mái khi di chuyển, đôi giày này có thân giày bằng vải lưới ôm chân như mang tất cùng khung bên ngoài bằng mút foam sinh học. Kết quả là một đôi giày siêu nhẹ và thoáng khí, chuyển động cùng bạn trên từng sải bước. Đây là phiên bản mới mẻ của một mẫu giày chạy bộ có thiết kế đầy tốc độ và thoải mái.', 'Nhật Bản', 6.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải lưới ôm chân như mang tất với lớp vỏ ngoài bằng mút foam sinh học\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su\r\nCó chứa tối thiểu 20% thành phần tái chế', 10, '2024-05-06 14:35:46', '2024-05-19 23:06:52'),
(10, 'GIÀY SUPERSTAR ADIFOM', 1500000.00, 4, 'Đôi giày adidas Superstar đang tiến vào metaverse với cách biến tấu kiểu dáng mũi vỏ sò độc đáo này. Phiên bản slip-on hầm hố này làm bằng mút xốp có sử dụng cây mía để tạo ra một thiết kế độc nhất vô nhị. Đây là bước tiến tiên phong vào phát triển bền vững và tương lai của thời trang.\r\n\r\nĐôi giày này làm từ chất liệu tự nhiên và có thể tái tạo, là một phần trong hành trình của chúng tôi hướng tới chấm dứt sử dụng tài nguyên hữu hạn và góp phần loại bỏ rác thải nhựa.', 'Úc', 9.00, 'Dáng regular fit\r\nDáng slip-on\r\nThân giày nguyên khối làm bằng mút foam có nguồn gốc từ mía\r\nSử dụng tối thiểu 50% chất liệu tự nhiên và có thể tái tạo', 10, '2024-05-06 14:35:46', '2024-05-14 02:37:53'),
(11, 'GIÀY FORUM LOW CLASSIC', 2500000.00, 1, 'ĐÔI GIÀY TÁO BẠO BẠN SẼ MUỐN MANG MÃI KHÔNG RỜI.\r\nSuốt gần 40 năm, giày Forum đã đóng vai trò không thể thiếu trong bộ sưu tập adidas. Đôi Giày Forum Low Classic này gợi nhớ bề dày lịch sử ấy đồng thời sở hữu thiết kế mới mẻ. Kết cấu nhiều lớp đặc trưng mà vẫn thuôn gọn, với đế ngoài bằng cao su tự nhiên vừa bám tốt lại vừa phong cách. Với thân giày bằng da và da nubuck bền bỉ, đôi giày trainer này là lựa chọn hoàn hảo cho những ngày dài bận rộn và những buổi tối hết mình.', 'Canada', 5.00, 'Có dây giày\r\nThân giày bằng da cật, da nubuck và da phủ\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su tự nhiên', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(12, 'GIÀY HANDBALL SPEZIAL', 2400000.00, 1, 'ĐÔI GIÀY ĐƯỢC ƯA CHUỘNG BỞI CÁC FAN BÓNG ĐÁ CŨNG NHƯ TÍN ĐỒ THỜI TRANG, LÀM TỪ DA LỘN.\r\nRa mắt lần đầu vào năm 1979 dành cho các cầu thủ bóng ném hàng đầu, đôi giày này giờ đây được yêu thích bởi phong cách classic. Phiên bản này có thân giày bằng da lộn cho cảm giác mềm dẻo. Đế gum mềm mại trung thành với thiết kế vintage.', 'Canada', 3.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng da lộn\r\nĐế gum\r\nTận hưởng sự thoải mái và hiệu năng của lót giày OrthoLite®\r\nCảm giác mềm mại', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(13, 'GIÀY GAZELLE', 2450000.00, 1, 'ĐÔI GAZELLE 1991 TÁI XUẤT VỚI PHIÊN BẢN MỘT ĐỐI MỘT.\r\nMẫu giày kinh điển không khoa trương. Ra đời là một đôi giày tập bóng đá, mẫu giày Gazelle này đã trở thành một biểu tượng thời trang đường phố. Đôi giày này tôn vinh phiên bản yêu thích năm 1991, giữ nguyên chất liệu, màu sắc và có kích thước rộng hơn chút đỉnh. Thân giày bằng da nubuck cho bề mặt mượt mà và cảm giác mềm mại.', 'Ai Cập', 3.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng da nubuck với các chi tiết phủ ngoài bằng da tổng hợp\r\nLớp lót bằng vải dệt\r\nTận hưởng sự thoải mái và hiệu năng của lót giày OrthoLite®\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(14, 'GIÀY GAZELLE BOLD', 2999000.00, 4, 'ĐÔI GIÀY GAZELLE CLASSIC NÂNG TẦM PHONG CÁCH ĐẦY TÁO BẠO.\r\nDanh sách những mẫu giày biểu tượng nhất của adidas không thể thiếu Gazelle. Ra mắt lần đầu trên các sân thể thao trong nhà vào thập niên 70, mẫu giày da lộn này hiện vẫn đang kết nạp các fan mới. Phong cách mà bạn hằng yêu thích giờ đây sẽ vươn lên tầm cao mới. Đế giày gồm ba lớp xếp chồng lên nhau, tạo nên góc nhìn mới từ phong cách classic. Các chi tiết vẫn đậm chất thể thao với chất liệu da lộn mềm mại và 3 Sọc răng cưa. Logo \"Gazelle\" màu vàng ánh kim khẳng định chất di sản.', 'Việt Nam', 9.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng da lộn\r\nLớp lót bằng chất liệu tổng hợp\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-14 02:37:40'),
(15, 'NMD_G1', 3900000.00, 4, 'Tương lai gặp những tác phẩm kinh điển. Những đôi giày adidas này xoắn các chi tiết tiến bộ với DNA của một huyền thoại chạy bộ thập niên 80. Phần trên đan thoáng khí giúp mọi thứ thoáng mát và lớp phủ cao su tạo thêm lợi thế cyberpunk. Cảm nhận quá khứ và tương lai cùng một lúc dưới chân: BOOST sang trọng và đế giữa EVA mang lại sự thoải mái với vẻ ngoài retro. Kéo mấu ở lưỡi và gót chân là một cái gật đầu với phong cách OG adidas. Những đôi giày này mời bạn tham gia vào tương lai trước khi nó ở đây.', 'Đức', 5.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng da nubuck với các chi tiết phủ ngoài bằng da tổng hợp\r\nLớp lót bằng vải dệt\r\nTận hưởng sự thoải mái và hiệu năng của lót giày \r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-14 02:41:46'),
(16, 'GIÀY CỔ THẤP FORUM', 2500000.00, 1, 'ĐÔI GIÀY BÓNG RỔ TRỨ DANH TRONG THIẾT KẾ CỔ THẤP.\r\nKhông chỉ là một đôi giày, mà chính là một tuyên ngôn. Dòng adidas Forum ra mắt năm 1984 và cực kỳ được ưa chuộng cả trên sân bóng rổ lẫn trong giới âm nhạc. Mẫu mới của dòng giày kinh điển này tái hiện tinh thần thập niên 80, nguồn năng lượng bùng nổ trên sân đấu cũng như thiết kế quai cổ chân chữ X đặc trưng, kết tinh thành phiên bản cổ thấp đậm chất đường phố.', 'Hàn Quốc', 3.00, 'Có dây giày và quai tùy chỉnh\r\nThân giày bằng da\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(17, 'HANDBALL SPEZIAL W', 2300000.00, 1, 'Mẫu giày kinh điển không khoa trương. Ra đời là một đôi giày tập bóng đá, mẫu giày HANDBALL SPEZIAL W này đã trở thành một biểu tượng thời trang đường phố. Đôi giày này tôn vinh phiên bản yêu thích năm 1991, giữ nguyên chất liệu, màu sắc và có kích thước rộng hơn chút đỉnh. Thân giày bằng da cho bề mặt mượt mà và cảm giác mềm mại.', 'Canada', 3.00, 'Dáng regular fit\r\nCó dây giày\r\nCác chi tiết phủ ngoài bằng da tổng hợp\r\nLớp lót bằng vải dệt\r\nTận hưởng sự thoải mái và hiệu năng của lót giày \r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(18, 'STAN SMITH XLG', 3000000.00, 1, 'Vẻ đẹp kinh điển. Phong cách vốn dĩ. Đa năng hàng ngày. Suốt hơn 50 năm qua và chưa dừng ở đó, giày adidas Stan Smith luôn giữ vững vị trí là một biểu tượng. Đôi giày này là phiên bản cải biên mới mẻ, là một phần cam kết của adidas hướng tới chỉ sử dụng polyester tái chế bắt đầu từ năm 2024. Với thân giày vegan và đế ngoài làm từ cao su phế liệu, đôi giày này vẫn mang phong cách đầy tính biểu tượng, đồng thời thân thiện với môi trường.', 'Việt Nam', 3.00, 'áng regular fit\r\nCó dây giày\r\nLớp lót bằng chất liệu tổng hợp\r\nĐế ngoài bằng cao su\r\nVegan', 10, '2024-05-06 14:35:46', '2024-05-19 23:04:42'),
(19, 'FORUM LOW CL W', 2600000.00, 1, 'Mang một đôi giày adidas giản dị này và một ngày của bạn sẽ có một khởi đầu đầy phong cách. Sự pha trộn giữa da và da lộn kết hợp với nhau để tạo ra một phần trên vừa thoải mái vừa tinh tế. Một lớp lót terry thêm một lớp mềm mại ấm cúng dưới chân. Và thiết kế Diễn đàn cổ điển có nghĩa là đôi giày này kết hợp hoàn hảo với mọi thứ từ quần short tee và jean yêu thích của bạn đến đan chunky - đó là tính linh hoạt tốt nhất.', 'Trung Quốc', 5.00, 'Có dây giày và quai tùy chỉnh\r\nThân giày bằng da\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:35:46', '2024-05-06 15:11:59'),
(20, 'GIÀY SUPERSTAR LUX', 3700000.00, 1, 'ĐÔI GIÀY KINH ĐIỂN VỚI THIẾT KẾ NÂNG TẦM CHẤT LIỆU VÀ PHONG CÁCH.\r\nDành cho những ai yêu thích nghệ thuật chế tác, đôi giày adidas Superstar này nâng tầm một thiết kế biểu tượng. Thân giày bằng da cao cấp và lớp lót bằng da mềm mại ôm trọn bàn chân bạn đầy thoải mái, cùng mũi giày vỏ sò đặc trưng tôn vinh năm thập kỷ thể thao và phong cách đường phố được cải biên dành cho ngày nay. Bất kể kết hợp với outfit thoải mái hay trang trọng hơn một chút, đôi giày này sẽ mang đến nét thanh lịch cho cuộc sống hàng ngày của bạn.', 'Việt Nam', 3.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng da\r\nLớp lót bằng da', 10, '2024-05-06 14:35:46', '2024-05-19 23:02:19'),
(21, 'GIÀY RESPONSE SUPER', 3200000.00, 1, 'ĐÔI GIÀY CHẠY BỘ SIÊU NHẸ CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\r\nTận hưởng cảm giác thoải mái và chuyên dụng với đôi giày hỗ trợ chạy bộ đến từ adidas này. Với thân giày bằng vải lưới thoáng khí, đôi giày sneaker siêu nhẹ này giúp bạn cảm thấy mỗi bước chân đều êm như mộng. Đế giữa Dreamstrike toàn phần nâng niu từng sải bước mỗi khi bạn khám phá phố phường hay trên cung đường chạy bộ yêu thích.\r\n\r\nSản phẩm này có chứa tối thiểu 20% chất liệu tái chế. Bằng cách tái sử dụng các chất liệu đã được tạo ra, chúng tôi góp phần giảm lãng phí và giảm phụ thuộc vào các nguồn tài nguyên hữu hạn, cũng như giảm phát thải từ các sản phẩm mà chúng tôi sản xuất.', 'Mỹ', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày monomesh kỹ thuật\r\nCảm giác thoáng khí\r\nLớp lót bằng vải dệt\r\nĐế giữa Dreamstrike', 10, '2024-05-06 14:37:00', '2024-05-19 23:00:44'),
(22, 'GIÀY RUNFALCON 3', 180000.00, 4, 'ĐÔI GIÀY CHẠY BỘ ÊM ÁI CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\r\nXỏ chân vào để chạy bộ trong công viên hoặc dạo bước tới quán cafe với đôi giày chạy bộ adidas đa năng này. Đôi giày mang đến cảm giác dễ chịu ngay từ giây phút mới xỏ chân vào nhờ đế giữa Cloudfoam êm ái. Thân giày bằng vải dệt cho cảm giác thoải mái và thoáng khí, cùng đế ngoài bằng cao su cho độ bám vượt trội để sải bước thêm phần tự tin.\r\n\r\nLàm từ một loạt chất liệu tái chế, thân giày có chứa tối thiểu 50% thành phần tái chế. Sản phẩm này đại diện cho một trong số rất nhiều các giải pháp của chúng tôi hướng tới chấm dứt rác thải nhựa.', 'Anh', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải dệt\r\nĐế giữa Cloudfoam\r\nLớp lót bằng vải dệt\r\nTrọng lượng: 549.25 g', 10, '2024-05-06 14:37:00', '2024-05-14 02:39:40'),
(23, 'GIÀY ADIZERO BOSTON 12', 4000000.00, 4, 'ĐÔI GIÀY TẬP CHÚ TRỌNG TỐC ĐỘ VỚI CÔNG NGHỆ CHUYÊN DỤNG.\r\nBoston Marathon là một giải đua. Nhưng đồng thời cũng là một mục tiêu, một kế hoạch tập luyện và cả những tháng ngày bạn ngóng đợi tới giờ thi đấu chính thức. Giày Adizero Boston 12 có thiết kế dành cho đường chạy cự ly trung bình tới cự ly dài. Đôi giày này mang đến cho giờ tập cảm giác hệt như trên đường đua nhờ cảm giác bùng nổ đến từ các thanh ENERGYROD 2.0 bằng sợi thủy tinh giúp hạn chế tiêu hao năng lượng. Giày có cấu tạo đầy tốc độ mà không kém phần bền bỉ — đế giữa kết hợp đệm LIGHTSTRIKE PRO siêu nhẹ và phiên bản mới của đệm LIGHTSTRIKE 2.0 EVA bền chắc.', 'Úc', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải lưới siêu nhẹ\r\nLớp lót bằng vải dệt\r\nCác thanh ENERGYROD hạn chế tiêu hao năng lượng\r\nĐệm Lightstrike Pro', 10, '2024-05-06 14:37:00', '2024-05-14 02:38:38'),
(24, 'GIÀY SAMBAE', 2700000.00, 4, 'PHIÊN BẢN ĐẲNG CẤP CỦA ĐÔI GIÀY ĐƯỢC YÊU THÍCH TRÊN TOÀN THẾ GIỚI.\r\nĐôi giày adidas Sambae này mang đến nét biến tấu hiện đại cho một thiết kế đầy tính biểu tượng. Từng là một mẫu giày bóng đá trong nhà, phiên bản này có thân giày bằng da mượt mà, đế gum trong mờ và 3 Sọc thêu nổi cao cấp cho phong cách không kém phần phù hợp khi xuống phố. Các chi tiết tinh tế như phần mũi giày may lộn tạo nên thiết kế thời trang và ấn tượng.', 'Việt Nam', 6.00, 'áng regular fit\r\nCó dây giày\r\nThân giày bằng da và da nubuck\r\nLớp lót bằng vải dệt\r\nĐế gum trong mờ', 10, '2024-05-06 14:37:00', '2024-05-14 02:38:06'),
(25, 'GIÀY ĐÁ BÓNG TURF PREDATOR 24 CLUB', 1600000.00, 4, 'NHẮM TRÚNG MỤC TIÊU VỚI ĐÔI GIÀY ĐÁ BÓNG DÀNH CHO SÂN CỎ NHÂN TẠO, CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\r\nBóng đá là phải ghi bàn, vậy nên đôi giày đá bóng này được thiết kế để phá lưới khung thành. Trong từng cú sút. Mọi khoảnh khắc. Nhắm mục tiêu hoàn hảo với đôi giày adidas Predator hoàn toàn mới. Với lớp mút xốp thoải mái và các chi tiết Strikeprint ở phần má trong bàn chân, thân giày bằng chất liệu tổng hợp cho diện mạo và cảm giác chuẩn chỉnh. Bên dưới là đế đinh bằng cao su đảm bảo bạn luôn ở vị trí hoàn hảo để chinh phục mục tiêu.\r\n\r\nSản phẩm này có chứa tối thiểu 20% chất liệu tái chế. Bằng cách tái sử dụng các chất liệu đã được tạo ra, chúng tôi góp phần giảm lãng phí và giảm phụ thuộc vào các nguồn tài nguyên hữu hạn, cũng như giảm phát thải từ các sản phẩm mà chúng tôi sản xuất.', 'Ai Cập', 3.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng chất liệu tổng hợp với vân bám Strikeprint\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su phù hợp với sân cỏ nhân tạo\r\nCó chứa tối thiểu 20% thành phần tái chế', 10, '2024-05-06 14:37:00', '2024-05-14 02:40:35'),
(26, 'GIÀY D.O.N. ISSUE 5', 3200000.00, 4, 'ĐÔI GIÀY SIGNATURE ĐẾN TỪ DONOVAN MITCHELL VÀ ADIDAS BASKETBALL.\r\nNgay từ lần đầu tiên bước lên sân bóng rổ, Donovan Mitchell đã luôn là kẻ thay đổi cuộc chơi, kể cả khi lối chơi của anh ngày càng trưởng thành và thăng hoa. Đôi giày signature D.O.N. Issue 5 đến từ adidas Basketball này tiếp tục phát huy cá tính trên sân của Spida cũng như tinh thần hoạt động xã hội của anh. Với đế giữa Lightstrike siêu nhẹ và đế ngoài bằng cao su độc đáo kèm vân bám tăng cường, đôi giày trainer bóng rổ này giúp bạn làm chủ trận đấu hệt như một trong những cầu thủ bóng rổ xuất sắc nhất.', 'Ý', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng chất liệu tổng hợp\r\nLớp đệm Lightstrike\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:37:00', '2024-05-14 02:38:21'),
(27, 'GIÀY CHẠY BỘ ULTRABOOST LIGHT', 5200000.00, 4, 'ĐÔI GIÀY CHẠY BỘ ĐÀN HỒI CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\r\nDi chuyển thật nhẹ nhàng và thoải mái. Đôi giày chạy bộ đàn hồi dành cho nữ này được trang bị lớp đệm BOOST nhẹ nhất từ trước đến nay của chúng tôi. Với mỗi sải chân, đế giữa siêu đàn hồi hoàn trả năng lượng giúp bạn vững bước trên suốt đường chạy. Thân giày và lớp lót bằng vải dệt ôm trọn bàn chân bạn cho cảm giác thoáng khí và nâng đỡ, cùng đế ngoài bằng cao su bám tốt suốt những buổi chạy khí thế nhất. Phù hợp để chạy bộ hàng ngày nhưng cũng không kém phần thời thượng để mang hàng ngày, hãy trải nghiệm sự thoải mái và tốc độ và khai phá nguồn năng lượng của riêng bạn.\r\n\r\nSản phẩm này có chứa tối thiểu 20% chất liệu tái chế. Bằng cách tái sử dụng các chất liệu đã được tạo ra, chúng tôi góp phần giảm lãng phí và giảm phụ thuộc vào các nguồn tài nguyên hữu hạn, cũng như giảm phát thải từ các sản phẩm mà chúng tôi sản xuất.', 'Anh', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải dệt\r\nLớp lót bằng vải dệt\r\nĐế giữa BOOST siêu nhẹ\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:37:00', '2024-05-14 02:39:24'),
(28, 'GIÀY COURTIC', 1700000.00, 4, 'ĐÔI GIÀY PHONG CÁCH RETRO CÓ SỬ DỤNG THÀNH PHẦN TÁI CHẾ.\r\nThời đại mới đi cùng phong cách mới. Đó chính là những gì chúng tôi đã gửi gắm trên đôi giày adidas này. Giày mang phong cách classic lấy cảm hứng từ các bộ môn bóng rổ, trượt ván và aerobic, nhưng với nét đổi mới đầy hiện đại. Chất liệu da vô cùng mềm mại và sang chảnh kết hợp cùng các đường cắt độc đáo cho vẻ ngoài vừa laid-back lại vừa đẳng cấp. Kết hợp với quần jeans ống loe và áo sweatshirt cổ tròn, vậy là bạn đã sẵn sàng xuống phố.\r\n\r\nSản phẩm này có sử dụng thành phần tái chế từ rác thải sản xuất, chẳng hạn như vật liệu cắt bỏ, cũng như rác thải sinh hoạt sau tiêu dùng, nhằm giảm thiểu tác động môi trường do sử dụng thành phần nguyên sinh trong sản xuất.', 'v', 5.00, 'Dáng regular fit\r\nThân giày bằng da\r\nLớp lót bằng vải dệt\r\n25% thân giày làm từ chất liệu có chứa tối thiểu 50% thành phần tái chế', 10, '2024-05-06 14:37:00', '2024-05-14 02:40:17'),
(29, 'GIÀY GALAXY 6', 1800000.00, 4, 'ĐÔI GIÀY THỂ THAO THOẢI MÁI CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\r\nXỏ giày và xuất phát. Đôi giày chạy bộ adidas này sẽ giúp bạn luôn thoải mái dẫu cho ngày mới kéo dài vô tận. Đây là một đôi giày hàng ngày tuyệt vời, với thân giày bằng vải lưới siêu nhẹ và thoáng khí giúp đôi chân bạn luôn mát mẻ, cùng đế giữa Cloudfoam đàn hồi. Đế ngoài bằng cao su bám vững vàng trên mọi bề mặt, từ sân cỏ ẩm ướt tới sân đất nện. Bạn có thể thoải mái thay đổi kế hoạch mà không cần đổi giày.\r\n\r\nLàm từ một loạt chất liệu tái chế, thân giày có chứa tối thiểu 50% thành phần tái chế. Sản phẩm này đại diện cho một trong số rất nhiều các giải pháp của chúng tôi hướng tới chấm dứt rác thải nhựa.', 'Việt Nam', 7.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày bằng vải dệt\r\nLót giày OrthoLite®\r\nĐế giữa Cloudfoam\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su', 10, '2024-05-06 14:37:00', '2024-05-14 02:39:09'),
(30, 'GIÀY NIZZA', 1300000.00, 1, 'ĐÔI GIÀY PHONG CÁCH BÓNG RỔ ICONIC NAY ĐƯỢC CẢI BIÊN ĐỂ MANG HÀNG NGÀY.\r\nDựa trên đôi giày trainer bóng rổ huyền thoại năm 1974, đôi giày adidas Nizza này vẫn luôn vô đối về phong cách. Phiên bản cổ thấp này có thân giày bằng vải canvas thoải mái và đế ngoài chắc chắn, giúp ghi điểm trong từng sải bước. Logo 3 Sọc đặc trưng cho tất cả mọi người thấy bạn là ngôi sao của trận đấu.\r\n\r\nCác sản phẩm cotton của chúng tôi hỗ trợ ngành trồng bông bền vững hơn.', 'Ai Cập', 5.00, 'Dáng regular fit\r\nCó dây giày\r\nThân giày vải canvas với các chi tiết bằng da tổng hợp\r\nLớp lót bằng vải dệt\r\nĐế ngoài bằng cao su\r\nMade with Better Cotton', 10, '2024-05-06 14:37:00', '2024-05-19 22:59:45'),
(31, 'Air Jordan 1 Low', 3254000.00, 6, 'Lấy cảm hứng từ bản gốc ra mắt vào năm 1985, Air Jordan 1 Low mang đến một cái nhìn cổ điển, sạch sẽ, quen thuộc nhưng luôn tươi mới. Với thiết kế mang tính biểu tượng kết hợp hoàn hảo với bất kỳ sự phù hợp nào, những cú đá này đảm bảo bạn sẽ luôn đi đúng hướng.', 'Việt Nam', 5.00, 'Bộ phận đế khí đóng gói cung cấp đệm nhẹ.\r\nDa thật ở phía trên mang lại độ bền và vẻ ngoài cao cấp.\r\nĐế ngoài bằng cao su rắn giúp tăng cường lực kéo trên nhiều bề mặt khác nhau.', 10, '2024-05-06 14:38:13', '2024-05-14 02:35:48'),
(32, 'Jordan Nu Retro 1 Low', 3100000.00, 6, 'Hai mươi năm sau và những ngọn thấp này đã trở lại. Lấy cảm hứng từ logo Wings ban đầu và thiết kế của Jordan 1, những đôi giày hàng ngày này đã sẵn sàng cho bất cứ điều gì. Rock \'em với một số quần jean rộng thùng thình, trượt băng trong \'em hoặc chỉ nhìn bay — tùy thuộc vào bạn. Phần trên bằng da mịn và logo nổi lớn sẽ giúp bạn nổi bật cho dù bạn ăn mặc lên hay xuống.', 'Việt Nam', 5.00, 'Công nghệ Nike Air hấp thụ tác động để đệm theo từng bước.\r\nCổ áo có đệm cắt thấp, vừa vặn thoải mái quanh mắt cá chân của bạn.\r\nĐế cao su cung cấp cho bạn lực kéo dồi dào.', 10, '2024-05-06 14:38:13', '2024-05-14 02:41:04'),
(33, 'Jordan Stadium 90', 4000000.00, 6, 'Sự thoải mái là vua, nhưng điều đó không có nghĩa là bạn phải hy sinh phong cách. Lấy cảm hứng thiết kế từ AJ1 và AJ5, Sân vận động 90 đã sẵn sàng để mặc hàng ngày. Phần trên được làm từ da và dệt thoáng, vì vậy bạn có được cả độ thoáng khí và độ bền, và đệm Nike Air ở đế giữ cho mỗi bước chân của bạn nhẹ nhàng và đệm.', 'Trung Quốc', 5.00, 'Phần trên bền bỉ được làm từ da thật, da tổng hợp và vật liệu dệt.\r\nCông nghệ Nike Air hấp thụ tác động để đệm theo từng bước.\r\nĐế ngoài bằng cao su cung cấp lực kéo hàng ngày.\r\nĐế ngoài bằng cao su tỏ lòng tôn kính với AJ1\r\nChi tiết ngọn lửa và thương hiệu gót chân tham chiếu đến AJ5', 10, '2024-05-06 14:38:13', '2024-05-14 02:40:52'),
(34, 'Luka 2 PF', 4123000.00, 4, 'Bạn mang lại tốc độ. Chúng tôi sẽ mang lại sự ổn định. Luka 2 được xây dựng để hỗ trợ các kỹ năng của bạn, với sự nhấn mạnh vào các bước lùi, bước bên và hành động dừng nhanh. Đế giữa xếp chồng lên nhau có đệm chắc chắn, linh hoạt để tăng khả năng phản hồi khi bạn di chuyển qua lại trên sân. Trên cùng, thiết kế lồng bọc toàn bộ chân giúp bạn kiềm chế cho dù bạn đang giả vờ hậu vệ hay lái xe xuống làn đường. Với tất cả công nghệ đó trong một gói nhẹ, chúng tôi đã bảo vệ hiệu quả.', 'Việt Nam', 7.00, 'Một chiếc lồng chắc chắn bao quanh toàn bộ phía trên để hỗ trợ kết nối 360 độ giúp bàn chân của bạn được giữ an toàn, bất kể bạn bước theo cách nào — hoặc bạn dừng lại nhanh như thế nào.\r\n\r\nPhiên bản PF được thiết kế với độ vừa vặn rộng hơn và được tối ưu hóa để chơi trên các sân ngoài trời.', 10, '2024-05-06 14:38:13', '2024-05-14 02:35:10'),
(35, 'Air Jordan 1 Mid', 16990000.00, 6, 'PHONG CÁCH DI SẢN, TIỆN NGHI CAO CẤP TRONG VÀ NGOÀI SÂN ĐẤU.\r\n\r\nAir Jordan 1 Mid mang đến phong cách toàn sân và sự thoải mái cao cấp cho một cái nhìn mang tính biểu tượng. Đệm đơn vị Air-Sole của nó chơi trên gỗ cứng, trong khi cổ áo đệm mang lại cho bạn cảm giác hỗ trợ.', 'Việt Nam', 5.00, 'Da cao cấp và phần trên tổng hợp mang lại độ bền, sự thoải mái và hỗ trợ.\r\nBộ phận Air-Sole ở gót chân mang lại lớp đệm đặc trưng.\r\nĐế ngoài bằng cao su cung cấp lực kéo trên nhiều bề mặt khác nhau.', 10, '2024-05-06 14:38:13', '2024-05-06 15:11:59'),
(36, 'Air Jordan 1 Low SE', 2314000.00, 6, 'Màu sắc tươi mới mang đến cho bạn AJ1 cập nhật mà không làm mất đi hình bóng mang tính biểu tượng và cảm giác quen thuộc. Được làm từ da cao cấp, sản phẩm được yêu thích mọi thời đại này được trang trí với đệm Nike Air thoải mái và các chi tiết thiết kế tinh tế (kiểm tra gót thêu đó) để mang đến cho bạn một đôi giày thể thao chủ lực với vẻ ngoài hiện đại.', 'Việt Nam', 5.00, 'Da thật ở phía trên mang lại độ bền và cấu trúc.\r\nThiết bị Nike Air đóng gói cung cấp đệm nhẹ.\r\nCao su ở đế ngoài giúp cung cấp cho bạn lực kéo bền bỉ, lý tưởng để mặc hàng ngày.\r\nThủng trên ngón chân\r\nLogo cánh trên gót chân\r\nThêu logo Jumpman trên lưỡi', 10, '2024-05-06 14:38:13', '2024-05-14 02:35:28'),
(37, 'Air Jordan 1 Mid', 2356000.00, 6, 'Lấy cảm hứng từ AJ1 ban đầu, phiên bản mid-top này duy trì vẻ ngoài mang tính biểu tượng mà bạn yêu thích trong khi màu sắc lựa chọn và da sắc nét mang lại cho nó một bản sắc riêng biệt.', 'Indonesia', 5.00, 'Da, da tổng hợp và vải dệt phía trên cho cảm giác nâng đỡ.\r\nĐế giữa bằng mút xốp và đệm Nike Air mang lại sự thoải mái nhẹ.\r\nĐế ngoài bằng cao su với vòng tròn trục mang lại cho bạn lực kéo bền bỉ.', 10, '2024-05-06 14:38:13', '2024-05-14 02:36:33'),
(38, 'Jordan Max Aura 5', 1945000.00, 6, 'Khi bạn cần một đôi giày sẵn sàng 24/7, đó phải là Max Aura 5. Lấy cảm hứng từ AJ3, cặp đá này đặt một vòng quay hiện đại vào cổ điển. Chúng được làm từ da bền và vải dệt nằm trên gót chân của đệm Nike Air để bạn có thể đi bộ, chạy hoặc trượt băng cả ngày mà vẫn có đế cảm giác tươi mới.', 'Việt Nam', 5.00, 'Các đơn vị Nike Air-Sole cung cấp đệm nhẹ.\r\nĐế ngoài bằng cao su bổ sung nhiều lực kéo hàng ngày.\r\nNhựa chắc chắn quanh gót chân thêm hỗ trợ.', 10, '2024-05-06 14:38:13', '2024-05-14 02:36:53'),
(39, 'Zion 3 M.U.D.', 999000.00, 4, 'Tinh tế trên chân, thống trị trên sân: Zion III này là M.U.D. (Made Uniquely Different). Da nubuck và da lộn mang đến cho bạn vẻ ngoài sang trọng. Dây đeo chân trước phiên bản đặc biệt cho phép bạn tùy chỉnh thiết bị ngăn chặn của mình, trong khi Zoom Air có chiều dài đầy đủ tiếp tục tạo nên sự khác biệt cho cặp đôi này. Thêu bùn tông màu làm tăng thêm sự bền bỉ cho phần trên của Light Bone siêu sạch sẽ — một lời nhắc nhở về những gì cần thiết để đạt được sự vĩ đại.', 'Việt Nam', 5.00, 'Phiên bản PF được thiết kế để phù hợp rộng rãi để chơi trên các sân ngoài trời.', 10, '2024-05-06 14:38:13', '2024-05-14 02:36:18'),
(40, 'Jumpman MVP', 1599000.00, 4, 'Chúng tôi đã không phát minh ra bản phối lại — nhưng xem xét chất liệu chúng tôi lấy mẫu, đây là điều không cần bàn cãi. Chúng tôi đã lấy các yếu tố từ AJ6, 7 và 8, biến chúng thành một đôi giày hoàn toàn mới kỷ niệm chức vô địch 3 than bùn đầu tiên của MJ. Với các chi tiết da, dệt và nubuck, những đôi giày thể thao này tôn vinh một di sản đồng thời khuyến khích bạn gắn kết di sản của riêng mình.', 'Việt Nam', 5.00, 'Phía trên là sự pha trộn của các yếu tố AJ6 và AJ7: Phần trên lưỡi và lớp phủ được sửa đổi tham chiếu đến AJ6 trong khi lớp lót bán chiến lợi phẩm tôn vinh AJ7.\r\nLogo gót Nike Air thêu tham chiếu đến AJ6 và chi tiết gót chân đúc đến từ AJ8.\r\nThiết kế đế ngoài là một cái gật đầu với AJ6.\r\nThiết bị Nike Air-Sole đóng gói cung cấp đệm nhẹ.', 10, '2024-05-06 14:38:59', '2024-05-14 02:34:01'),
(41, 'Jordan 1 Mid SE', 3145000.00, 6, 'Lấy cảm hứng từ kết cấu và màu sắc của hộ chiếu và những con tem mà MJ có được trong các chuyến lưu diễn vòng quanh thế giới của mình, những chiếc J này là những lời nhắc nhở đầy phong cách rằng dù họ nhỏ bé đến đâu, ước mơ của họ vẫn lớn. Giữ thẻ hành lý đi kèm như một vật trang trí mát mẻ cho giày (hoặc vali) của họ.', 'Indonesia', 5.00, 'Hỗn hợp các vật liệu ở phía trên ưu tiên sự thoải mái và độ bền.\r\nĐế ngoài bằng cao su cho lực kéo hàng ngày.\r\nDây buộc cổ điển', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(42, 'Jordan Legacy 312 Low', 3254000.00, 6, 'Jordan Legacy 312 Low Baby and Toddler Shoe kỷ niệm di sản của MJ với thiết kế lấy cảm hứng từ 3 đôi giày Jordan mang. Đế giữa và đế ngoài thoải mái cung cấp hỗ trợ linh hoạt cho bàn chân nhỏ.', 'Indonesia', 7.00, 'Thiết kế được lấy cảm hứng từ các yếu tố từ Air Jordan 1, Air Jordan 3 và Alpha Force.\r\nDa và phần trên tổng hợp cung cấp khả năng ngăn chặn an toàn và hỗ trợ thoải mái.\r\nĐế giữa và đế ngoài bằng mút bền, mềm mại và linh hoạt để hỗ trợ đệm.\r\nDây đeo không chức năng trên bàn chân giữa.', 10, '2024-05-06 14:38:59', '2024-05-14 02:30:44'),
(43, 'GIÀY NIKE AIR ZOOM PEGASUS 40', 500000.00, 2, 'Giày Nike Air Zoom Pegasus 40 là siêu phẩm giày thể thao được mong chờ nhất năm 2024 này. Đây là phiên bản thứ 40 của dòng giày huyền thoại Nike Pegasus và thật tuyệt vời, Nike Air Zoom Pegasus 40 đã có mặt sớm nhất tại cửa hàng Ngọc Bích rồi.', 'Việt Nam', 5.00, 'Đầu tiên xét đến ngoại hình, Nike Pegasus 40 có thiết kế thừa hưởng từ phiên bản Pegasus 39 nhưng với nhiều cải tiến vượt trội về chất liệu và công nghệ.\r\n\r\nThứ 2: Phần Upper của giày được là từ chất liệu Mesh dày dặn và có độ đàn hồi tốt hơn nhưng rất khoáng khí, khiến form giày được giữ rất tốt trong quá trình sử dụng. Thiết kế upper khiến cảm giác lên chân cực kỳ thoải mái vừa vặn và hấp dẫn.\r\n\r\nThứ 3: Phần đế giữa với sự kế hợp 2 công nghệ đỉnh cao của Nike đó là React và Air Zoom tạo lên độ đàn hồi và êm ái tuyệt vời. Bạn có thể sử dụng Giày Nike Air Zoom Pegasus 40 cho các cuộc chạy đường dài như Marathon hay chạy ngắn tốc độ cao đều rất phù hợp.\r\n\r\nThứ 4: Nike Air Zoom Pegasus 40 được thiết kế tối ưu cho việc chạy bộ, bàn chân bạn sẽ có cảm giác chuyển động cực kỳ mượt mà từ ngón chân cho đến gót chân, năng lượng được tiết kiệm tối đa giúp bạn có thể sử dụng cả ngày mà không gây nhức mỏi hay làm bạn bị tổn thương.\r\n\r\nCuối cùng, Giày Nike Pegasus 40 là sản phẩm chiến lược của Nike nên họ đã đưa vào siêu phẩm này những công nghệ tốt nhất biến nó trở thành mẫu giày thể thao tuyệt nhất .', 10, '2024-05-06 14:38:59', '2024-05-14 02:17:11'),
(44, 'GIÀY NIKE DOWNSHIFTER 13', 6600000.00, 2, 'Giày Nike DownShifter 13 mẫu giày thể thao mới nhất của Nike có thiết kế cực đẹp và hiện đại. Với kiểu dáng được thiết kế hoàn toàn mới và công nghệ được cải tiến rất nhiều so với phiên bản trước đó. Nike DownShifter 13 thật sự là lựa chọn tuyệt vời dành cho bạn.', 'Canada', 5.00, 'Nike DownShifter 13 với phần Upper được là từ chất liệu nhẹ cực kỳ thoáng khí, đế giữa được cải tiến khiến cho đôi giày trở lên êm, nhẹ cảm giác lên chân tuyệt vời.\r\n\r\nNgoài ra, Nike DownShifter 13 còn có mức giá hợp lý khiến nó trở thành mẫu giày thể thao khó có thể bỏ qua trong năm nay.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(45, 'GIÀY NIKE METCON 9', 5240000.00, 2, 'Giày Nike Metcon 9 là một trong mẫu giày Training & Gym mới nhất và tốt nhất hiện nay. Với thiết kế đẹp cùng công nghệ đỉnh cao, đây chắc chắn là mẫu giày hoàn hảo cho phòng tập.', 'Việt Nam', 5.00, 'Phần upper với chất liệu thoáng khí và đàn hồi tốt, đế giữa êm ái cùng với đế ngoài cực kỳ bền chắc mang đến cho Nike Metcon 9 sự hoàn thiện và an toàn đối đa cho mọi động tác luyện tập dù là phức tạp nhất. \r\n\r\nNgoài ra với phần hỗ trợ chống lật tuyệt đối khiến cho Nike Metcon 9 trở thành đôi giày tập luyện an toàn nhất cho các động tác phức tạp.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(46, 'GIÀY NIKE RUN SWIFT 3', 5321000.00, 2, 'Giày Nike Run Swift 3 là mẫu giày được thiết kế cực kỳ đẹp và tinh tế với đặc điểm rất thoáng khí, êm và rất nhẹ. Đây là mẫu giày có thể sử dụng trong mọi hoạt động hàng ngày.', 'Việt Nam', 5.00, 'Với phần upper làm bằng chất liệu vải mesh mềm mại và thoáng giúp vận động thoải mái. Phần đế giữa bằng vật liệu siêu nhẹ khiến cho Nike Run Swift 3 là mẫu giày rất được yêu thích.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(47, 'GIÀY NIKE SB HERITAGE VULC', 3256000.00, 2, 'Giày Nike SB Heritage Vulc là dòng giày sneaker có thiết kế classic được rất nhiều người yêu thích. Một mẫu giày bạn có thể tự tin sử dụng trong mọi hoàn cảnh mà không sợ lỗi mốt.', 'Việt Nam', 5.00, 'Phần upper của giày được làm từ chất liệu da lộn cao cấp, đế giày làm bằng cao su với công nghệ độc quyền của Nike siêu bền.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(48, 'GIÀY NIKE AIR MAX INTRLK', 2387000.00, 2, 'Giày Nike Air Max INTRLK là mẫu giày với thiết kế vô cùng thời trang của Nike với sự kết hợp hài hòa giữa quá khứ và hiện đại.', 'Việt Nam', 5.00, 'Phần đế giữa của Nike Air Max INTRLK được thiết kế rất hợp lý mềm mại với công nghệ tiên tiến nhất của Nike. Chắc chắn đây là mẫu giày mà bất cứ fan Sneaker không thể bỏ qua', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(49, 'GIÀY NIKE WEARALLDAY', 1645000.00, 2, 'Giày Nike Wearallday là mẫu giày được các nhà thiết kế của NIKE giúp bạn có thể mang nó ca ngày mà không bị bí bách, khó chịu đúng như tên gọi của nó - wearallday.', 'Việt Nam', 5.00, 'Kiểu dáng trẻ trung giúp bạn tự tin kết hợp cùng các kiêu Outfit khác nhau.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(50, 'GIÀY NIKE EBERNON LOW', 150000.00, 2, 'Giày Nike Ebernon Low là mẫu giày thời trang có thiết kế đẹp của Nike', 'Việt Nam', 5.00, 'chất liệu upper làm từ chất jean bền chắc và đế cao su bền chắc sẽ khiến bạn vô cùng hài lòng khi sử dụng.', 10, '2024-05-06 14:38:59', '2024-05-14 02:31:54'),
(51, 'GIÀY NIKE JUNIPER TRAIL', 360000.00, 2, 'Giày Nike Juniper Trail là một mẫu giày trail có thiết kế rất thời trang. Bạn có thể sử dụng mẫu giày này để chạy bộ hay đi lại hàng ngày đều rất phù hợp.', 'Việt Nam', 5.00, 'Với thiết kế đẹp, phần upper chất liệu vải mesh thoáng khí và bộ đế cực kỳ êm ái. Giày Nike Juniper Trail sẽ giúp bạn thoải mái đi lại trong cả ngày dài.', 10, '2024-05-06 14:38:59', '2024-05-14 02:16:47'),
(52, 'GIÀY NIKE SB ALLEYOOP', 569900.00, 2, 'Giày Nike SB Alleyoop là dòng giày sneaker có thiết kế đơn giản nhưng đẹp mắt, được rất nhiều người yêu thích. Một mẫu giày bạn có thể tự tin sử dụng trong mọi hoàn cảnh mà không sợ lỗi mốt.', 'Việt Nam', 5.00, 'Phần upper của giày được làm từ chất liệu da lộn cao cấp kết hợp với vải Canvas chắc chắn chịu va chạm mài mòn tốt, đế giày làm bằng cao su với công nghệ độc quyền của Nike siêu bền.', 10, '2024-05-06 14:38:59', '2024-05-14 02:18:19'),
(53, 'GIÀY NIKE FLEX EXPERIENCE 12', 1700000.00, 2, 'Giày Nike Flex Experience 12 mẫu giày thể thao mới ra mắt của Nike với thiết kế tối giản nhưng đẹp mắt và công năng sử dụng đa dạng. Bạn có thể dùng để đi bộ, chạy bộ, đi chơi đi làm đều rất tốt.', 'Việt Nam', 5.00, 'Giày Nike Flex Experience 12 với phần Upper được là từ chất liệu nhẹ cực kỳ thoáng khí, đế giữa được cải tiến khiến cho đôi giày trở lên êm, nhẹ cảm giác lên chân tuyệt vời.\r\n\r\nPhần đế giữa có thiết kế xẻ rãnh đặc biệt, giúp bàn chân di chuyển thật dễ dàng khi sử dụng.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(54, 'GIÀY NIKE AIR ZOOM PEGASUS 40', 1999000.00, 2, 'Giày Nike Air Zoom Pegasus 40 là siêu phẩm giày thể thao được mong chờ nhất năm 2023 này. Đây là phiên bản thứ 40 của dòng giày huyền thoại Nike Pegasus và thật tuyệt vời, Nike Air Zoom Pegasus 40 đã có mặt sớm nhất .', 'Việt Nam', 5.00, 'Đầu tiên xét đến ngoại hình, Nike Pegasus 40 có thiết kế thừa hưởng từ phiên bản Pegasus 39 nhưng với nhiều cải tiến vượt trội về chất liệu và công nghệ.\r\n\r\nThứ 2: Phần Upper của giày được là từ chất liệu Mesh dày dặn và có độ đàn hồi tốt hơn nhưng rất khoáng khí, khiến form giày được giữ rất tốt trong quá trình sử dụng. Thiết kế upper khiến cảm giác lên chân cực kỳ thoải mái vừa vặn và hấp dẫn.\r\n\r\nThứ 3: Phần đế giữa với sự kế hợp 2 công nghệ đỉnh cao của Nike đó là React và Air Zoom tạo lên độ đàn hồi và êm ái tuyệt vời. Bạn có thể sử dụng Giày Nike Air Zoom Pegasus 40 cho các cuộc chạy đường dài như Marathon hay chạy ngắn tốc độ cao đều rất phù hợp.\r\n\r\nThứ 4: Nike Air Zoom Pegasus 40 được thiết kế tối ưu cho việc chạy bộ, bàn chân bạn sẽ có cảm giác chuyển động cực kỳ mượt mà từ ngón chân cho đến gót chân, năng lượng được tiết kiệm tối đa giúp bạn có thể sử dụng cả ngày mà không gây nhức mỏi hay làm bạn bị tổn thương.', 10, '2024-05-06 14:38:59', '2024-05-14 02:17:59'),
(55, 'GIÀY NIKE COURT VISION LOW', 999999.00, 2, 'Giày Nike Court Vision Low là mẫu giày với thiết kế lấy cảm hứng từ thập niên 80 với những nét cổ điển mang phong cách đường phố đặc trưng.', 'Việt Nam', 5.00, 'Với chất liệu da cao cấp và đến cao su nguyên chất khiến đôi giày bền bỉ với thời gian.', 10, '2024-05-06 14:38:59', '2024-05-14 02:34:11'),
(56, 'GIÀY NIKE AIR MAX INTRLK LITE', 2389000.00, 2, 'Giày Nike Air Max INTRLK Lite là mẫu giày với thiết kế vô cùng thời trang của Nike với sự kết hợp hài hòa giữa quá khứ và hiện đại.', 'Việt Nam', 5.00, 'Phần đế giữa của Nike Air Max INTRLK Lite được thiết kế rất hợp lý mềm mại với công nghệ tiên tiến nhất của Nike. Chắc chắn đây là mẫu giày mà bất cứ fan Sneaker không thể bỏ qua', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(57, 'GIÀY NIKE DOWNSHIFTER 13', 996000.00, 2, 'Giày Nike DownShifter 13 mẫu giày thể thao mới nhất của Nike có thiết kế cực đẹp và hiện đại. Với kiểu dáng được thiết kế hoàn toàn mới và công nghệ được cải tiến rất nhiều so với phiên bản trước đó. Nike DownShifter 13 thật sự là lựa chọn tuyệt vời dành cho bạn.', 'Việt Nam', 5.00, 'Nike DownShifter 13 với phần Upper được là từ chất liệu nhẹ cực kỳ thoáng khí, đế giữa được cải tiến khiến cho đôi giày trở lên êm, nhẹ cảm giác lên chân tuyệt vời.\r\n\r\nNgoài ra, Nike DownShifter 13 còn có mức giá hợp lý khiến nó trở thành mẫu giày thể thao khó có thể bỏ qua trong năm nay.', 10, '2024-05-06 14:38:59', '2024-05-14 02:33:36'),
(58, 'GIÀY ADIDAS VL COURT BASE', 550000.00, 1, 'Giày adidas VL Court Base được thiết kế phong cách cổ điển nhưng đẹp mãi với thời gian. Một mẫu giày bạn có thể sử dụng trong mọi hoàn cảnh và luôn phù hợp dù ở bất cứ nơi đâu.', 'Việt Nam', 3.00, 'Phần Upper được làm từ da cao cấp với logo đặc trưng của adidas, đế giày chất liệu cao su siêu bền, chắc chắn hỗ trợ từng bước chân.', 10, '2024-05-06 14:38:59', '2024-05-14 02:33:12'),
(59, 'GIÀY ADIDAS RUN 80S', 999000.00, 1, 'Giày adidas Run 80S là mẫu giày sneaker có thiết kế cổ điển của thập niên 80 nhưng rất đẹp và không bao giờ lỗi mốt. adidas Run 80S có thể sử dụng trong mọi hoạt động hàng ngày.', 'Việt Nam', 5.00, 'Về thiết kế của adidas Run 80S với upper được làm từ chất liệu da lộn cao cấp kết hợp vải mesh thoáng khí, đế giữa chất liệu êm ái và đế ngoài bằng cao su bền bỉ chịu mài mòn tốt.', 10, '2024-05-06 14:38:59', '2024-05-14 02:32:59'),
(60, 'GIÀY NIKE METCON 9', 1120000.00, 2, 'Giày Nike Metcon 9 là một trong mẫu giày Training & Gym mới nhất và tốt nhất hiện nay. Với thiết kế đẹp cùng công nghệ đỉnh cao, đây chắc chắn là mẫu giày hoàn hảo cho phòng tập.', 'Việt Nam', 5.00, 'Phần upper với chất liệu thoáng khí và đàn hồi tốt, đế giữa êm ái cùng với đế ngoài cực kỳ bền chắc mang đến cho Nike Metcon 9 sự hoàn thiện và an toàn đối đa cho mọi động tác luyện tập dù là phức tạp nhất. \r\n\r\nNgoài ra với phần hỗ trợ chống lật tuyệt đối khiến cho Nike Metcon 9 trở thành đôi giày tập luyện an toàn nhất cho các động tác phức tạp.', 10, '2024-05-06 14:38:59', '2024-05-06 15:11:59'),
(61, 'GIÀY NIKE MC TRAINER 2', 2400000.00, 2, 'Giày Nike MC Trainer 2 một mẫu giày luyện tập tuyệt với dành cho tất cả mọi người. Với kiểu dáng thời trang, thiết kế đơn giản nhưng vô cùng hiệu quả trong việc tập luyện thể thao.', 'Việt Nam', 5.00, 'Điều đặc biệt đầu tiên khi nhìn Nike MC Trainer 2 là \"diện mạo\'\' bên ngoài đã được thiết kế Trẻ Trung, Khỏe Khoắn, Năng Động hơn so với các đàn anh đi trước- đúng như tinh thần Just Do It của Nike.\r\n\r\nUpper được sử dụng vải Mesh tạo sự thông thoáng, thoải mái cho người sử dụng. Đế giày tạo cảm giác chắc chắn, đồng thời cũng giúp bạn tránh khỏi các chấn thương không đáng có trong quá trình tập luyện.', 10, '2024-05-06 14:38:59', '2024-05-14 02:31:37'),
(62, 'GIÀY PUMA SMASH CAT L - TRẮNG ĐEN', 3000000.00, 3, 'Giày Puma Smash Cat L mẫu giày có thiết kế đơn giản mà đẹp mắt. Logo hình con báo đặc trưng của Puma được thêu tỉ mỉ trên thân giày tạo nét nổi bật khó cưỡng lại.', 'Việt Nam', 3.00, 'Chất liệu da cao cấp và đế cao su bền bỉ chắc chắn sẽ làm hài lòng những khách hàng khó tính nhất. Bạn sẽ luôn yên tâm rằng nó không bao giờ bị lỗi mốt.', 10, '2024-05-06 14:39:29', '2024-05-12 08:58:30'),
(63, 'GIÀY PUMA V6 LOW NAM - TRẮNG XANH', 1450000.00, 3, 'Giày Puma V6 Low là mẫu giày có thiết kế tuyệt đẹp cổ điển mà rất tinh tế.', 'Việt Nam', 3.00, 'Chất liệu da cao cấp và đế cao su bền bỉ chắc chắn sẽ làm hài lòng những khách hàng khó tính nhất. Bạn sẽ luôn yên tâm rằng nó không bao giờ bị lỗi mốt.', 10, '2024-05-06 14:39:29', '2024-05-14 02:15:22'),
