(65, 'GIÀY PUMA PWRFRAME TR 2 NAM - ĐEN XANH', 1560000.00, 3, 'Đây chính là mẫu giày đa năng tuyệt vời cho luyện tập thể thao, tập gym và các hoạt động hàng ngày.', 'Việt Nam', 3.00, 'Giày Puma PWRFrame TR 2 mẫu giày training có thiết kế rất đẹp cùng với những công nghệ cao cấp của Puma.', 10, '2024-05-06 14:39:29', '2024-05-12 08:57:21'),
