(69, 'GIÀY PUMA SLIPSTREAM EVERYWHERE NAM NỮ - TRẮNG', 1200000.00, 3, 'Puma Slipstream Everywhere là lựa chọn không thể bỏ qua của các fan giày sneaker.', 'Việt Nam', 5.00, 'Giày Puma Slipstream Everywhere mẫu giày sneaker rất nổi tiếng của Puma, thiết kế cổ điển nhưng đẹp và không bao giờ lo lỗi mốt.', 10, '2024-05-06 14:39:29', '2024-05-14 02:14:25'),
(70, 'GIÀY PUMA NEO CAT MOTORSPORT NAM - TRẮNG', 1599000.00, 3, 'Puma Neo Cat có thiết kế đẹp, phù hợp với mọi hoạt động hàng ngày đặc biệt là khi lái xe.', 'Việt Nam', 3.00, 'Giày Puma Neo Cat Motorsport là mẫu giày thể thao đậm chất Puma, với kiểu dáng khỏe khắn và chất liệu cao cấp.', 10, '2024-05-06 14:39:29', '2024-05-14 02:15:06'),
