(74, 'GIÀY PUMA SLIPSTREAM ARCHIVE REMASTERED NAM - TRẮNG XANH', 2500000.00, 3, 'Giày Puma Slipstream Archive Remastered mẫu giày sneaker rất nổi tiếng của Puma, thiết kế cổ điển nhưng đẹp và không bao giờ lo lỗi mốt.', 'Việt Nam', 5.00, 'Puma Slipstream Archive Remastered là lựa chọn không thể bỏ qua của các fan giày sneaker.', 10, '2024-05-06 14:39:29', '2024-05-14 02:16:12'),
(75, 'GIÀY PUMA TRAMP OG NAM - NÂU', 3100000.00, 3, 'Giày Puma Tramp OG là một trong mẫu giày Classic huyền thoại của Puma. Được làm bằng da lộn cao cấp, sang trọng, đế giày cực kỳ bền đẹp. Đây là một mẫu giày tuyệt vời dành dành cho mọi hoạt động hàng ngày.', 'Việt Nam', 3.00, 'Phần Upper chất liệu da lộn cao cấp siêu bền, đế giày chất liệu cao su nguyên chất chiệu ma sát và mài mòn cực tốt.', 10, '2024-05-06 14:39:29', '2024-05-06 15:11:59'),
(76, 'GIÀY PUMA SUEDE BULK NAM - CAMO', 1699000.00, 3, 'Giày Puma Suede là một trong mẫu giày Classic huyền thoại của Puma. Được làm bằng da lộn cao cấp, sang trọng, đế giày cực kỳ bền đẹp. Đây là một mẫu giày tuyệt vời dành dành cho mọi hoạt động hàng ngày.', 'Việt Nam', 3.00, 'Phần Upper chất liệu da lộn cao cấp siêu bền, đế giày chất liệu cao su nguyên chất chiệu ma sát và mài mòn cực tốt.', 10, '2024-05-06 14:39:29', '2024-05-06 15:11:59'),
(77, 'GIÀY PUMA SUEDE BULK NAM - ĐEN TRẮNG', 2377000.00, 3, 'Giày Puma Suede là một trong mẫu giày Classic huyền thoại của Puma. Được làm bằng da lộn cao cấp, sang trọng, đế giày cực kỳ bền đẹp. Đây là một mẫu giày tuyệt vời dành dành cho mọi hoạt động hàng ngày.', 'Việt Nam', 3.00, 'Phần Upper chất liệu da lộn cao cấp siêu bền, đế giày chất liệu cao su nguyên chất chiệu ma sát và mài mòn cực tốt.', 10, '2024-05-06 14:39:29', '2024-05-14 02:14:04'),
(78, 'GIÀY PUMA SUEDE BULK NAM - NAVY NÂU', 1690000.00, 3, 'Giày Puma Suede là một trong mẫu giày Classic huyền thoại của Puma. Được làm bằng da lộn cao cấp, sang trọng, đế giày cực kỳ bền đẹp. Đây là một mẫu giày tuyệt vời dành dành cho mọi hoạt động hàng ngày.', 'Việt Nam', 5.00, 'Phần Upper chất liệu da lộn cao cấp siêu bền, đế giày chất liệu cao su nguyên chất chiệu ma sát và mài mòn cực tốt.', 10, '2024-05-06 14:39:29', '2024-05-06 15:11:59'),
(79, 'GIÀY PUMA RALPH SAMPSON JAPAN NAM NỮ - TRẮNG', 1400000.00, 3, 'Giày Puma Ralph Sampson Japan là một trong mẫu giày Classic huyền thoại của Puma. Được làm bằng da mềm mại, cao cấp, sang trọng, đế giày cực kỳ bền đẹp. Đây là một mẫu giày tuyệt vời dành để đi học, đi làm, đi chơi...', 'Việt Nam', 5.00, 'Ở phiên bản Ralph Sampson Japan này Puma thiết kế dành dành cho Nhật Bản với những chi tiết đặc biệt và tinh tế mang đạm phong cách của Nhật.', 10, '2024-05-06 14:39:29', '2024-05-06 15:11:59'),
(80, 'GIÀY PUMA SOFTRIDE CRUISE 2 NAM - XANH NAVY', 16800000.00, 3, 'Giày Puma Softride Cruise 2 có thiết kế rất đẹp cùng với những công nghệ cao cấp của Puma.', 'Việt Nam', 5.00, 'Với trọng lượng rất nhẹ và bộ đế cực kỳ êm ái Puma Softride Cruise 2 mang đến cho người đi cảm giác rất linh hoạt và năng động.', 10, '2024-05-06 14:39:29', '2024-05-14 02:32:06'),
(81, 'GIÀY PUMA CAVEN MERCEDES NAM - ĐEN XANH', 1370000.00, 3, 'Giày Puma Caven mẫu giày cổ điển được phát triển từ những năm 1980 của Puma. \r\nĐặc biệt ở phiên bản này Puma đã hợp tác với Mercedes để tạo ra sản phẩm thật sự cao cấp và thời thượng.', 'Việt Nam', 5.00, 'Chất liệu da cao cấp và đế cao su bền bỉ chắc chắn sẽ làm hài lòng những khách hàng khó tính nhất. Bạn sẽ luôn yên tâm rằng nó không bao giờ bị lỗi mốt.', 10, '2024-05-06 14:39:29', '2024-05-14 02:15:41');
