(89, 'GIÀY PUMA SMASH CAT L NAM NỮ - TRẮNG ĐỎ', 3000000.00, 3, 'Giày Puma Smash Cat L mẫu giày có thiết kế đơn giản mà đẹp mắt. Logo hình con báo đặc trưng của Puma được thêu tỉ mỉ trên thân giày tạo nét nổi bật khó cưỡng lại.', 'Việt Nam', 3.00, 'Chất liệu da cao cấp và đế cao su bền bỉ chắc chắn sẽ làm hài lòng những khách hàng khó tính nhất. Bạn sẽ luôn yên tâm rằng nó không bao giờ bị lỗi mốt.', 10, '2024-05-06 14:39:29', '2024-05-06 15:11:59'),
(90, 'GIÀY PUMA X RAY TRAINERS NAM - TRẮNG', 1390000.00, 3, 'Giày Puma X Ray Trainers là một trong mẫu giày thể thao có có thiết kế đơn giản mà rất tinh tế. Một mẫu giày mà bạn có thế sử dụng trong mọi hoạt động hàng ngày.', 'Việt Nam', 5.00, 'Giày Puma X Ray Trainers với phần upper được trang bị vải mesh rất thoáng khí, phần đế giữa Softride cao cấp của Puma cho độ êm vượt trội.', 10, '2024-05-06 14:41:35', '2024-05-06 15:11:59'),
(91, 'Giày Tây nam MWC - 6627 Giày Tây Nam Đế Cao Mũi Nhọn Da Mềm, Dập Vân Cách Điệu Thời Trang Thanh Lịch', 270000.00, 8, 'Sản phẩm hoàn hảo từ thiết kế, kiểu dáng cho tới chất liệu,chất da nguyên miếng nhập khẩu tạo nên vẻ bóng lì rất hút mắt và sang trọng, dập vân cách điệu thời trang, phối khóa nhỏ tinh tế  Thiết kế này rất \"dễ tính\" khi phối đồ,bạn có thể mix giày cùng trang phục trẻ trung như sơ mi dáng ôm và quần chinos có độ dài trên mắt cá chân,hay những bộ suit may đo lịch lãm cũng sẽ thêm phần hiện đại khi được phối cùng sản phẩm này.  Giày mang vẻ đẹp đầy quyền uy mà vẫn thời thượng, hiện đại. Khi sử dụng, bạn sẽ cực kỳ tự tin với một đôi giày êm chân và không gây bức bí khó chịu.', 'Việt Nam', 3.00, 'Kiểu dáng : Giày tây\r\nChất liệu :  da PU cao cấp \r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:41:35', '2024-05-12 09:00:00'),
(92, 'Giày mọi nam MWC - 6628 Giày Tây Nam Đế Cao Mũi Nhọn Da Mềm, Phối Dây Cách Điệu Thời Trang Thanh Lịch', 275000.00, 8, 'Sản phẩm hoàn hảo từ thiết kế,kiểu dáng cho tới chất liệu,chất da nguyên miếng nhập khẩu tạo nên vẻ bóng lì rất hút mắt và sang trọng, dập vân chỉ nổi cách điệu phối dây cực kì sang trọng và sành điệu.\r\n\r\nThiết kế này rất \"dễ tính\" khi phối đồ,bạn có thể mix giày cùng trang phục trẻ trung như sơ mi dáng ôm và quần chinos có độ dài trên mắt cá chân,hay những bộ suit may đo lịch lãm cũng sẽ thêm phần hiện đại khi được phối cùng sản phẩm này.\r\n\r\nGiày mang vẻ đẹp đầy quyền uy mà vẫn thời thượng, hiện đại. Khi sử dụng, bạn sẽ cực kỳ tự tin với một đôi giày êm chân và không gây bức bí khó chịu.', 'Việt Nam', 3.00, 'Kiểu dáng : giày tây\r\n\r\nChiều cao : 4cm\r\n\r\nChất liệu :  da PU cao cấp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:41:35', '2024-05-12 08:59:29'),
(93, 'Giày Slipon nam MWC NASL- 6066', 295000.00, 8, 'Thiết kế dạng giày lười sỏ chân , mặt giày da trơn may viền tỉ mĩ , đế PVC ...\r\n\r\nGiày mang đến cho người mang 1 phong cách năng động và trẻ trung.\r\n\r\nVới những ưu điểm trên giày slipon không chỉ giúp bạn thể hiện phong cách thời trang riêng biệt mà còn dễ dàng phối cùng nhiều trang phục như: quần jean, áo thun hay phụ kiện khác để trở nên thật cá tính và thời trang', 'Việt Nam', 3.00, 'Kiểu dáng : Giày Slipon\r\n\r\nChiều cao : 3cm\r\n\r\nChất liệu : Da si mờ \r\n\r\nĐế : PVC êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:41:35', '2024-05-12 09:00:39'),
(94, 'Giày Tây nam MWC - 6626 Giày Tây Nam Đế Cao Mũi Nhọn Da Mềm, Dập Vân Kiểu Viền Chỉ Nổi Cách Điệu Thời Trang Thanh Lịch', 275000.00, 8, 'Sản phẩm hoàn hảo từ thiết kế, kiểu dáng cho tới chất liệu,chất da nguyên miếng nhập khẩu tạo nên vẻ bóng lì rất hút mắt và sang trọng, dập vân theo kiểu viền chỉ nổi thời trang.\r\n\r\nThiết kế này rất \"dễ tính\" khi phối đồ,bạn có thể mix giày cùng trang phục trẻ trung như sơ mi dáng ôm và quần chinos có độ dài trên mắt cá chân,hay những bộ suit may đo lịch lãm cũng sẽ thêm phần hiện đại khi được phối cùng sản phẩm này.\r\n\r\nGiày mang vẻ đẹp đầy quyền uy mà vẫn thời thượng, hiện đại. Khi sử dụng, bạn sẽ cực kỳ tự tin với một đôi giày êm chân và không gây bức bí khó chịu.', 'Việt Nam', 3.00, 'Kiểu dáng : giày tây\r\n\r\nChiều cao : 4cm\r\n\r\nChất liệu :  da PU bóng cao cấp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:41:35', '2024-05-19 22:45:07'),
