(112, 'Giày mọi nam MWC NAMO- 6665', 295000.00, 8, 'Giày thiết kế tối giản không cầu kì với mũi may viền chần chỉ nổi phối khóa dạng mắt xích,mặt giày sử dụng chất da nhám tổng hợp thời trang.\r\n\r\nThiết kế này rất \"dễ tính\" khi phối đồ,bạn có thể mix cùng nhiều trang phục khác nhau.\r\n\r\nGiày thiết kế xỏ chân cực kỳ tiện lợi,êm chân và không gây bức bí khó chịu khi mang trong thời gian dài.', 'Việt Nam', 2.00, 'Kiểu dáng : Giày mọi nam\r\n\r\nChiều cao : khoảng 2cm\r\n\r\nChất liệu :  da tổng hợp vân nhám\r\n\r\nĐế : PVC êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:42:49', '2024-05-12 08:54:44'),
(113, 'Giày cao gót MWC NUCG- 4466', 215000.00, 7, 'Thiết kế dáng mũi vuông với quai ngang được cắt thắt cách điệu,phối quai hậu có khoá cài,giảy sử dụng chất liệu da tổng hợp thời trang.\r\n\r\nSandal cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 8.00, 'Chiều cao : khoảng 8cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Sandal cao gót', 10, '2024-05-06 14:42:49', '2024-05-12 08:53:53'),
(114, 'Dép Cao Gót MWC - 4232 Dép Cao Gót Nữ Quai Ngang Chữ H Mũi Vuông Thời Trang', 235000.00, 9, 'Dép chữ H quốc dân đơn giản mà sang trọng.\r\n\r\nĐặc điểm nổi bật quai dép cắt hình chữ H thể hiện sự sang trọng và không bị lỗi mốt theo thời gian. \r\n\r\nPhù hợp cho mọi hoàn cảnh, đi làm, đi chơi, đi dạo phố vv…\r\n\r\nVới chất liệu da cao cấp, êm mềm, kết hợp cùng gót dạng vân gỗ cao cấp cực kì sang chảnh.\r\n\r\nDép chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào,vừa giúp tôn dáng cho các nàng vừa thể hiện được sự sang trọng và nữ tính.', 'Việt Nam', 5.00, 'Chiều cao gót 5cm\r\n\r\nChất liệu da tổng hợp\r\n\r\nChất liệu đế TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng dép cao gót', 10, '2024-05-06 14:42:49', '2024-05-16 09:37:23'),
(115, 'Giày cao gót MWC NUCG- 4412 Giày Sandal Cao Gót Quai Ngang Mảnh Đính Đá Cách Điệu Sang Chảnh Gót Nhọn Thời Trang', 215000.00, 7, 'Thiết kế với dáng mũi vuông,dây đính đá quai ngang, gót nhọn cao 8cm chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch', 'Việt Nam', 8.00, 'Chiều cao : 8cm\r\n\r\nChất liệu : Màu trắng và bạc da bóng , màu đen nhung \r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : sandal cao gót', 10, '2024-05-06 14:42:49', '2024-05-06 15:11:59'),
(116, 'Giày cao gót MWC NUCG- 4413 Sandal Cao Gót Nữ Quai Mãnh Chéo Đính Đá Sang Chảnh Gót Nhọn Thời Trang', 235000.00, 7, 'Với thiết kế dáng mũi nhọn,dây đính đá cùng quai đan chéo ngang,gót nhọn thời trang,chắc chắn và dễ đi,dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch…', 'Việt Nam', 8.00, 'Chiều cao : 8cm\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nChất liệu : da bóng \r\n\r\nKiểu dáng : Giày cao gót', 10, '2024-05-06 14:42:49', '2024-05-12 08:53:20'),
(117, 'Giày cao gót MWC NUCG- G030', 250000.00, 7, 'Thiết kế dáng mũi vuông với 3 quai dây mãnh tròn ngang chéo ôm chân và dễ đi, giày sử dụng chất liệu da tổng hợp thời trang.\r\n\r\nGiày sandal cao gót với dáng đế đúp cùng gót trụ vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 10.00, 'Chiều cao : khoảng 10cm\r\n\r\nChất liệu : da tổng hợp \r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Giày sandal cao gót', 10, '2024-05-06 14:42:49', '2024-05-12 08:46:21'),
(118, 'Giày cao gót MWC NUCG- 4389 Sandal Cao Gót Quai Ngang Đính Nơ,Gót Nhọn Phối Quai Hậu Thời Trang', 255000.00, 7, 'Thiết kế dáng gót vuông mảnh basic kéo chân dài miên man, quai ngang da bóng đính nơ bản to cách điệu,gót cao tầm 10cm,phối quai hậu chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nKiểu dáng được thiết kế chuẩn  bàn chân của phụ nữ Việt ,giúp tôn dáng cho các nàng vừa thể hiện được sự sang trọng và nữ tính.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch,...', 'Việt Nam', 10.00, 'Kiểu dáng : Sandal cao gót \r\n\r\nChiều Cao : 10cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:42:49', '2024-05-06 15:11:59'),
(119, 'Giày cao gót MWC NUCG- 4403 Cao Gót Đế Đúp Bít Mũi Bít Gót Phối Quai Hậu Thời Trang', 275000.00, 7, 'Thiết kế dáng đế đúp với mũi vuông,bít mũi,bít gót bằng da trơn có quai cài ,gót vuông cao 9cm chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch', 'Việt Nam', 9.00, 'Chiều cao : 9cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : cao gót đế đúp', 10, '2024-05-06 14:42:49', '2024-05-06 15:11:59'),
(120, 'Giày cao gót MWC -4225 Sandal Cao Gót Quai Ngang Bít Gót,Gót Vuông 8cm Phối Quai Hậu Thời Trang', 260000.00, 7, 'Sử dụng chất liệu da nhung cao cấp, lớp lót giày mềm mại cực kỳ êm chân. Đường may tỉ mỉ, form giày chuẩn đem lại cảm giác thoải mái cho bạn gái khi mang.\r\n\r\nBên cạnh đó, kiểu dáng hiện đại, thời trang giúp tôn vinh đôi chân của phái nữ.\r\n\r\nCó thể phối hợp với nhiều phong cách, phù hợp với nhiều hoàn cảnh như đi làm, dự tiệc, đi chơi, ....', 'Việt Nam', 9.00, 'Chiều cao gót 9cm\r\n\r\nChất liệu da nhung\r\n\r\nChất liệu đế TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng giày sandal cao gót có quai hậu', 10, '2024-05-06 14:43:59', '2024-05-12 03:08:30'),
(121, 'Giày cao gót MWC NUCG- G034', 200000.00, 7, 'Thiết kế với dáng mũi oval bút mũi bít gót với mặt giày sử dụng chất liệu da tổng hợp vân nổi thời trang, đính khóa chữ sang chảnh.\r\n\r\nGiày cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 7.00, 'Chiều cao : khoảng 7cm\r\n\r\nChất liệu : da tổng hợp \r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Giày cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:41:30'),
(122, 'Giày Sandal Cao Gót MWC - 3547 Sandal Cao Gót Quai Ngang Gót Vuông 7cm Quai Hậu Thời Trang', 250000.00, 7, 'Với kiểu dáng Slingback,quai ngang sử dụng da tổng hợp, phối quai hậu gót vuông cao 7cm, chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào. vừa giúp tôn dáng cho các nàng vừa thể hiện được sự sang trọng và nữ tính. \r\n\r\nĐược thiết kế với form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân. Sản phẩm chắc chắn và bền bỉ.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch,..', 'Việt Nam', 7.00, 'Chiều cao gót 7cm\r\n\r\nChất liệu da tổng hợp \r\n\r\n Chất liệu đế TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng giày sandal cao gót có quai hậu', 10, '2024-05-06 14:43:59', '2024-05-12 08:48:20'),
(123, 'Giày cao gót MWC NUCG- 4397 Sandal Cao Gót Quai Chéo Nhún Phối Quai Hậu Gót Vuông Thời Trang', 150000.00, 7, 'Thiết kế mũi vuông với quai da dây mãnh phối quai bèo nhún đan chéo,đế 2 lớp,lót da sọc caro thời trang,gót vuông cao 6cm, chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nĐược thiết kế với form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch', 'Việt Nam', 6.00, 'Kiểu dáng : sandal cao gót có quai hậu\r\n\r\nChiều cao : 6cm\r\n\r\nChất liệu : da tổng hợp phối lưới\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:43:59', '2024-05-12 08:33:33'),
(124, 'Dép Cao Gót MWC - 4311 Dép Cao Gót Nữ Quai Ngang Gót Vuông Vân Gỗ Cao 5cm Mũi Vuông Thời Trang', 195000.00, 7, 'Kiểu dáng đơn giản,với thiết kế quai ngang basic.\r\n\r\nGót vuông vân gỗ cao 5cm kết hợp mũi vuông trẻ trung, tạo cho bạn một vẻ ngoài sang trọng và nữ tính. \r\n\r\nDù bạn là một cô gái cá tính hay điệu đà, dép cao gót vẫn luôn có cách để tôn vinh tính cách của bạn.\r\n\r\nDép chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào. \r\n\r\nVừa giúp tôn dáng cho các nàng vừa thể hiện được sự sang trọng và nữ tính.', 'Việt Nam', 5.00, 'Chiều cao gót 5cm\r\n\r\nChất liệu da tổng hợp\r\n\r\nChất liệu đế TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng dép cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:37:29'),
(125, 'Giày cao gót MWC NUCG- G037', 295000.00, 7, 'Thiết kế với dáng mũi tròn,bít mũi phối quai ngang đính nơ tiểu thư xinh xắn,giày sử dụng chất liệu da bóng sang chảnh, gót vuông chắc chắn và thời trang.\r\n\r\nGiày cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 5.00, 'Chiều cao : khoảng 5cm\r\n\r\nChất liệu : da bóng\r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Giày cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 04:34:54'),
