(127, 'Giày cao gót MWC NUCG- 4469', 250000.00, 7, 'Thiết kế dáng Slingback bít mũi phối quai chéo cùng quai hậu đính đá sang chảnh,mặt giày sử dụng chất liệu da phủ lụa xoắn cách điệu,thời trang.\r\n\r\nGiày cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 6.00, 'Chiều cao : 6cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Giày cao gót', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(128, 'Giày cao gót MWC NUCG- 4492', 235000.00, 7, 'Thiết kế dáng bít mũi Oval với mặt trơn đơn giãn phối quai ngang nơ thắt tạo điểm nhấn,quai hậu có chun co giãn,giày được sử dụng chất liệu da tổng hợp thời trang.\r\n\r\nGiày cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 3.00, 'Chiều cao : khoảng 3cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Giày cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:34:24'),
(129, 'Giày cao gót MWC NUCG- G006', 250000.00, 7, 'Thiết kế với dáng mũi oval bít mũi bít gót với mặt giày sử dụng chất liệu da tổng hợp thời trang đính nơ nhỏ trái tim cách điệu.\r\n\r\nGiày cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 9.00, 'Chiều cao : khoảng 9cm\r\n\r\nChất liệu : da tổng hợp \r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Giày cao gót\r\n\r\nXuất xứ thương hiệu : Việt Nam\r\n\r\nChú ý : Kích thước so sánh một cách cẩn thận,vui lòng cho phép sai số 1-3 cm do đo lường thủ công\r\n\r\nDo màn hình hiển thị khác nhau và ánh sáng khác nhau, hình ảnh có thể chênh lệch 5->10% màu sắc thật của sản phẩm\r\n\r\nCảm ơn bạn đã thông cảm.', 10, '2024-05-06 14:43:59', '2024-05-12 08:37:14'),
(130, 'Giày cao gót MWC NUCG- 4445', 265000.00, 7, 'Thiết kế dáng mũi vuông sử dụng chất liệu da bóng với hai quai mãnh đính đá kèm nơ bướm bằng đá lung linh tạo điểm nhấn, phối quai hậu 2 trong 1 thời trang.\r\n\r\nCao gót với gót vuông thủy tinh vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 6.00, 'Chiều cao : 6cm\r\n\r\nChất liệu : da bóng\r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Sandal cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:48:47'),
(131, 'Giày cao gót MWC NUCG- 4466', 265000.00, 7, 'Thiết kế dáng mũi vuông với quai ngang được cắt thắt cách điệu,phối quai hậu có khoá cài,giảy sử dụng chất liệu da tổng hợp thời trang.\r\n\r\nSandal cao gót với dáng gót vuông vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch.', 'Việt Nam', 8.00, 'Chiều cao : khoảng 8cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Sandal cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:40:01'),
(132, 'Giày cao gót MWC - 4251 Giày Sandal Cao Gót Quai Ngang Cách Điệu Gót Trụ Thời Trang', 180000.00, 7, 'Thiết kế với quai ngang cách điệu phối quai hậu cùng gót trụ cao 7cm sẽ là điểm nhấn nổi bật của các nàng,giúp tăng sự sang trọng cho đôi chân của phái nữ giày dễ đi, và dễ dàng kết hợp cùng với bất kì trang phục nào.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch', 'Việt Nam', 7.00, 'Kiểu dáng : sandal cao gót\r\n\r\nChiều cao : 7cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:43:59', '2024-05-12 08:38:43'),
(133, 'Giày cao gót MWC NUCG- G023', 235000.00, 7, 'Thiết kế với 2 quai ngang bảng tròn được sử dụng chất liệu da tổng hợp thời trang.\r\n\r\nDép cao gót với dáng gót trụ dẹp vững chắc giúp cho nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp cho mọi hoàn cảnh, đi làm, đi chơi, đi dạo phố vv..', 'Việt Nam', 8.00, 'Chiều cao gót : khoảng 8cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nChất liệu đế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : dép cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:43:09'),
(134, 'Giày cao gót MWC NUCG- 4404 Sandal Cao Gót Quai Ngang Tròn Cách Điệu Gót Vuông Thời Trang', 300000.00, 7, 'Với thiết kế mũi vuông quai tròn ngang cách điệu sử dụng chất liệu da cao cấp gót vuông cao 4cm  thời trang,chắc chắn và dễ đi,dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch…', 'Việt Nam', 4.00, 'Chiều cao : 4cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng : Sandal cao gót', 10, '2024-05-06 14:43:59', '2024-05-12 08:43:26'),
(135, 'Giày Sandal Cao Gót MWC - 4247 Sandal Cao Gót Quai Ngang Nhún Cách Điệu Gót Vuông Cao 5cm Phối Quai Hậu Thời Trang', 180000.00, 9, 'Sandal cao gót được thiết kế với dáng quai ngang nhún cách điệu phối quai hậu 2 trong 1, gót vuông cao 5cm chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nĐược thiết kế form chuẩn với bàn chân của phụ nữ Việt Nam, sườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch', 'Việt Nam', 5.00, 'Kiểu dáng : sandal cao gót\r\n\r\nChiều cao : 5cm\r\n\r\nChất liệu : da tổng hợp\r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:43:59', '2024-05-16 09:37:52'),
(136, 'Giày Sandal Cao Gót MWC - 4207 Sandal Cao Gót Quai Ngang Nhún Cách Điệu Gót Trụ Phối Quai Hậu Thời Trang', 195000.00, 7, 'Thiết kế dáng gót trụ basic kéo chân dài miên man, quai ngang nhún cách điệu phối quai hậu\r\n\r\nGót trụ cao 8cm, chắc chắn và dễ đi, dễ dàng kết hợp với bất kì trang phục nào.\r\n\r\nVừa giúp tôn dáng cho các nàng vừa thể hiện được sự sang trọng và nữ tính. \r\n\r\nĐược thiết kế với form chuẩn với bàn chân của phụ nữ Việt Nam.\r\n\r\nSườn 4 lớp mang đến sự vững chắc giúp cho các nàng hoàn toàn tự tin trên từng bước chân. \r\n\r\nSản phẩm chắc chắn và bền bỉ.\r\n\r\nPhù hợp đi tiệc, đi làm, công sở, đi học, đi chơi, du lịch,..', 'Việt Nam', 8.00, 'Chiều cao gót 8cm\r\n\r\nChất liệu da tổng hợp\r\n\r\nChất liệu đế TPR êm mềm, độ đàn hồi tốt, chống trơn trượt\r\n\r\nKiểu dáng giày sandal cao gót có quai hậu', 10, '2024-05-06 14:43:59', '2024-05-12 08:36:58'),
(137, 'GIÀY NIKE INTERACT RUN SE NỮ - TRẮNG', 2090000.00, 2, 'Giày Nike Interact Run là mẫu giày mới ra mắt của Nike, được thiết kế cực kỳ đẹp, hiện đại trẻ trung với đặc điểm rất thoáng khí, êm và rất nhẹ. Đây là mẫu giày thể thao có thể sử dụng trong mọi hoạt động hàng ngày.', 'Việt Nam', 5.00, 'Với phần upper làm bằng chất liệu flyknit mềm mại và thoáng giúp vận động thoải mái. Phần đế giữa bằng vật liệu siêu nhẹ, êm với độ đàn hồi cao khiến cho Nike Interact Run là mẫu giày rất được yêu thích. Ngoài ra phần đế ngoài với dạng waffle giúp cho độ bám đường cao giúp an toàn khi di chuyển.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(138, 'GIÀY NIKE INTERACT RUN NỮ - HỒNG NHẸ', 2090000.00, 2, 'Giày Nike Interact Run là mẫu giày mới ra mắt của Nike, được thiết kế cực kỳ đẹp, hiện đại trẻ trung với đặc điểm rất thoáng khí, êm và rất nhẹ. Đây là mẫu giày thể thao có thể sử dụng trong mọi hoạt động hàng ngày.', 'Việt Nam', 5.00, 'Với phần upper làm bằng chất liệu flyknit mềm mại và thoáng giúp vận động thoải mái. Phần đế giữa bằng vật liệu siêu nhẹ, êm với độ đàn hồi cao khiến cho Nike Interact Run là mẫu giày rất được yêu thích. Ngoài ra phần đế ngoài với dạng waffle giúp cho độ bám đường cao giúp an toàn khi di chuyển.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(139, 'Giày Tây nam MWC - 6627 Giày Tây Nam Đế Cao Mũi Nhọn Da Mềm, Dập Vân Cách Điệu Thời Trang Thanh Lịch', 2190000.00, 8, 'Sản phẩm hoàn hảo từ thiết kế, kiểu dáng cho tới chất liệu,chất da nguyên miếng nhập khẩu tạo nên vẻ bóng lì rất hút mắt và sang trọng, dập vân cách điệu thời trang, phối khóa nhỏ tinh tế  Thiết kế này rất \"dễ tính\" khi phối đồ,bạn có thể mix giày cùng trang phục trẻ trung như sơ mi dáng ôm và quần chinos có độ dài trên mắt cá chân,hay những bộ suit may đo lịch lãm cũng sẽ thêm phần hiện đại khi được phối cùng sản phẩm này.  Giày mang vẻ đẹp đầy quyền uy mà vẫn thời thượng, hiện đại. Khi sử dụng, bạn sẽ cực kỳ tự tin với một đôi giày êm chân và không gây bức bí khó chịu.', 'Việt Nam', 5.00, 'Kiểu dáng : Giày tây\r\nChất liệu :  da PU cao cấp \r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:43:59', '2024-05-20 01:22:38'),
(140, 'GIÀY NIKE COURT VISION ALTA NỮ- ĐEN TRẮNG', 2189000.00, 2, 'Giày Nike Court Vision Alta một mẫu giày thời trang có thiết kế hiện đại, năng động của Nike. Đế giày cao tôn dáng cùng với chất liệu da  cao cấp khiến nó trở lên thu hút hơn bao giờ hết.', 'Việt Nam', 5.00, 'phần Upper được là từ chất liệu nhẹ cực kỳ thoáng khí, đế giữa được cải tiến khiến cho đôi giày trở lên êm, nhẹ cảm giác lên chân tuyệt vời.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(141, 'GIÀY NIKE REVOLUTION 7 NỮ - HỒNG NHẸ', 1590000.00, 2, 'Giày Nike Revolution 7 là một mẫu giày thể thao đa dụng có thiết kế cực đẹp và mức giá vô cùng tốt. Với nhiều cải tiến mới so với phiên bản Revolution 6 thì đây chắc chắn sẽ trở thành mẫu giày thể thao quốc dân của Nike trong năm nay.', 'Việt Nam', 5.00, 'Nike Revolution 7 được trang bị bộ đệm dày hơn cho độ êm và đàn hồi tốt hơn phiên bản trước. Phần upper với chất liệu vải mesh thoáng khi bền chắc nhưng vẫn mang đến cảm giác mềm mại cho bàn chân. Đế giữa với chất liệu React cùng với cộng nghệ Zoom nổi tiếng của Nike khiến đôi giày cực êm và phản lực tốt. Thiết đế đễ giữa của Nike Revolution 7 là điểm cộng lớn với đường nét cực kỳ sắc nét, gọn gàng tinh tế. Đế ngoài chất liệu cao su chịu mài mòn và bám đường rất tốt khi di chuyển. \r\n\r\nTóm lại, Nike Revolution 7 thật sự là mẫu giày dành cho tất cả mọi người, bạn có thể sử dụng cho mọi hoạt động hàng ngày như tập thể thao, chạy bộ, đi chơi, đi làm...Một mẫu giày thật sự rất đáng để chúng ta sở hữu trong năm nay.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(142, 'GIÀY NIKE AIR MAX COMMAND NỮ - TRẮNG XÁM', 2390000.00, 2, 'Giày Nike Air Max Command là một trong những sản phẩm kinh điển của hãng thể thao Nike, trải qua gần 30 năm lịch sử Nike Air Max Command đã làm say đắm hàng triệu người yêu giày trên thế giới.', 'Việt Nam', 5.00, 'Với thiết kế đẹp mắt, form dáng chắc chắn, cảm giác di chuyển vô cùng thoải mái cùng với công nghệ ngày càng hoàn hảo của Nike, Air Max Command là một sự lựa chọn tuyệt vời cho tất cả mọi người đặc biệt là bạn trẻ năng động. Đây chắc chắn sẽ là đôi giày giúp bạn tự tin trên mọi cung đường mà bạn bước đến.', 10, '2024-05-06 14:43:59', '2024-05-12 03:15:00'),
(143, 'GIÀY NIKE IN-SEASON TR 13 NỮ - XANH', 1790000.00, 2, 'Giày Nike In-Season TR 13 một mẫu giày luyện tập thiết kế đẹp, công nghệ tốt, phù hợp với tất cả mọi người từ vận động viên chuyên nghiệp cho đến người dùng phổ thông.', 'Việt Nam', 5.00, 'Upper của giày được sử dụng vải Mesh tạo sự thông thoáng, thoải mái cho người sử dụng. Đế giày êm ái rất phù hợp cho việc luyện tập thể thao, tập gym, đi bộ, chạy bộ. Nike In-Season TR 13 là mẫu giày thật sự đa năng.', 10, '2024-05-06 14:43:59', '2024-05-12 03:15:12'),
(144, 'GIÀY NIKE AIR MAX AP NỮ - TRẮNG CAM', 2390000.00, 2, 'Giày Nike Air Max AP là mẫu giày với thiết kế vô cùng thời trang của Nike với sự kết hợp hài hòa giữa quá khứ và hiện đại.', 'Việt Nam', 5.00, 'Phần đế giữa của Nike Air Max AP được thiết kế rất hợp lý mềm mại với công nghệ tiên tiến nhất của Nike. Chắc chắn đây là mẫu giày mà bất cứ fan Sneaker không thể bỏ qua', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(145, 'GIÀY NIKE REVOLUTION 7 NỮ - ĐEN HỒNG', 1590000.00, 2, 'Giày Nike Revolution 7 là một mẫu giày thể thao đa dụng có thiết kế cực đẹp và mức giá vô cùng tốt. Với nhiều cải tiến mới so với phiên bản Revolution 6 thì đây chắc chắn sẽ trở thành mẫu giày thể thao quốc dân của Nike trong năm nay.', 'Việt Nam', 5.00, 'Nike Revolution 7 được trang bị bộ đệm dày hơn cho độ êm và đàn hồi tốt hơn phiên bản trước. Phần upper với chất liệu vải mesh thoáng khi bền chắc nhưng vẫn mang đến cảm giác mềm mại cho bàn chân. Đế giữa với chất liệu React cùng với cộng nghệ Zoom nổi tiếng của Nike khiến đôi giày cực êm và phản lực tốt. Thiết đế đễ giữa của Nike Revolution 7 là điểm cộng lớn với đường nét cực kỳ sắc nét, gọn gàng tinh tế. Đế ngoài chất liệu cao su chịu mài mòn và bám đường rất tốt khi di chuyển. \r\n\r\nTóm lại, Nike Revolution 7 thật sự là mẫu giày dành cho tất cả mọi người, bạn có thể sử dụng cho mọi hoạt động hàng ngày như tập thể thao, chạy bộ, đi chơi, đi làm...Một mẫu giày thật sự rất đáng để chúng ta sở hữu trong năm nay.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(146, 'GIÀY NIKE AIR MAX SC NỮ - TRẮNG XÁM XANH', 1590000.00, 2, 'Giày Nike Air Max SC mang nét huyền thoại của Nike, với bộ đệm Air Max trứ danh đây là mẫu giày có thể kết hợp với bất cứ trang phục nào mà bạn vẫn hoàn toàn tự tin trong mọi hoàn cảnh.', 'Việt Nam', 5.00, 'Phần đế giữa của  Nike Air Max SC được thiết kế rất hợp lý mềm mại với công nghệ tiên tiến nhất của Nike. Chắc chắn đây là mẫu giày mà bất cứ fan Sneaker không thể bỏ qua', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(147, 'GIÀY NIKE ZOOM FLY 5 NỮ - TRẮNG ĐEN', 2590000.00, 2, 'Giày Nike Zoom Fly 5 là một trong những mẫu giày thể thao tốt nhất năm 2023. Với thiết kế ưu việt và công nghệ ZoomX mới nhất Nike Zoom Fly 5 là đôi giày tuyệt với dành cho việc chạy bộ, tập thể thao và đi lại hàng ngày.', 'Việt Nam', 5.00, 'Phần Upper được thiết kế với chất liệu flyknit đặc biệt siêu nhẹ và thoáng khí. Đế giữa với bộ đệm ZoomX trứ danh giúp nhẹ hơn và đàn hồi hơn phiên bản cũ khá nhiều. Cùng với sợi Carbon giúp cho đế giày cực kỳ êm và siêu bền. Bạn sẽ có cảm giác như bay khi di chuyển trên đôi giày này.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(148, 'GIÀY NIKE AIR MAX BOLT NỮ - TRẮNG', 2090000.00, 2, 'Giày Nike Air Max Bolt là mẫu giày Air Max có thiết kế trẻ trung năng động và rất sang chảnh. Kiểu dáng đẹp, cảm giác lên chân vô cùng thoải mái là những điểm khiến Nike Air Max Bolt hấp dẫn người sử dụng.', 'Việt Nam', 5.00, 'Phần Upper của giày được làm từ chất liệu mesh thoáng khí và da cao cấp, đế giữa với thiết lượn sóng cực kì thoải mái khi sử dụng. Giày Nike Air Max Bolt có thể sử dụng trong mọi hoạt động hàng ngày.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(149, 'GIÀY NIKE AIR MAX EXCEE NỮ - ĐEN TRẮNG', 1790000.00, 2, 'Giày Nike Air Max Excee mẫu giày thời trang năng động, trẻ trung Air Max Excee đã cập bến tại Myshoes.vn. Đây hứa hẹn sẽ là một mẫu giày chất chơi mà bạn không thể bỏ qua.', 'Việt Nam', 5.00, 'Phần đế giữa của Nike Air Max Excee được thiết kế rất hợp lý mềm mại với công nghệ tiên tiến nhất của Nike. Chắc chắn đây là mẫu giày mà bất cứ fan Sneaker không thể bỏ qua', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(150, 'GIÀY NIKE COURT ROYALE', 1390000.00, 2, 'Giày Nike Court Royale là mẫu giày với thiết kế lấy cảm hứng từ thập niên 70 với những nét cổ điển mang phong cách đường phố đặc trưng. Đây là mẫu giày không bao giờ lỗi mốt, có thể sự dụng trong mọi nhu cầu đi lại hàng ngày.', 'Việt Nam', 3.00, 'Với chất liệu da cao cấp và đến cao su nguyên chất khiến đôi giày bền bỉ với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-12 02:45:32'),
(151, 'GIÀY NIKE REACT INFINITY RUN FLYKNIT 3 NỮ - TÍM', 2290000.00, 2, 'Giày Nike React Infinity Run Flyknit 3 là mẫu giày nâng cấp từ dòng Nike React Infinity Run Flyknit 2 với những cải tiến vượt trội trong công nghệ. Đây có lẽ là đôi giày mà Nike đã dành tâm huyết nhiều nhất cho việc nghiên cứu và phát triển để tạo ra sự hoàn hảo nhất cho người sử dụng.', 'Việt Nam', 5.00, 'Upper vẫn sử dụng chất liệu Flyknit mới nhất được thiết kế theo hình ô caro khác hẳn so với các mẫu Epic. Logo Swoosh, được cách điệu lớn và cứng cáp hơn, sẽ giúp cho phần thân giày cứng cáp hơn.\r\n\r\nĐế giữa được sử dụng 100%  React tạo nên sự đàn hồi, hỗ trợ tạo đổ nẩy cho bàn chân trong suốt quá trình di chuyển, tập luyện. Đặc biệt, đôi giày này chỉ có trọng lượng 291 gam trọng lượng nhẹ hơn bao giờ hết.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59');
INSERT INTO `sanpham` (`id`, `ten`, `gia`, `thuonghieu_id`, `gioithieu`, `sanxuat`, `docao`, `mota`, `giamgia`, `created_at`, `updated_at`) VALUES
(152, 'GIÀY NIKE RENEW SERENITY RUN', 1790000.00, 2, 'Giày Nike Renew Serenity Run 2 một mẫu giày thể thao với thiết kế đẹp và hiện tại. Công nghệ tiên tiến của Nike giúp đôi giày trở lên rất nhẹ, vừa vặn với bàn chân, mọi chuyển động đều rất thoải mái nhẹ nhàng.', 'Việt Nam', 5.00, 'Bạn có thể sử dụng Giày Nike Renew Serenity Run 2 để đi cả ngày dài mà không cảm thấy mỏi mệt. Đây xứng đáng là mẫu giày phải có trong tủ giày của bạn.', 10, '2024-05-06 14:43:59', '2024-05-12 03:11:06'),
(153, 'GIÀY NIKE AIR MAX BELLA TR 5 NỮ - ĐEN HỒNG', 1590000.00, 2, 'Giày Nike Air Max Bella TR 5 là mẫu giày training với thiết kế vô cùng thời trang của Nike với sự kết hợp hài hòa giữa quá khứ và hiện đại.', 'Việt Nam', 5.00, 'Phần đế giữa của Nike Air Max Bella TR 5 được thiết kế rất hợp lý mềm mại với công nghệ tiên tiến nhất của Nike giúp nó trở thành một đôi giày luyện tập rất tốt dành cho các chị em.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(154, 'GIÀY NIKE COURT ROYALE AC', 1590000.00, 2, 'Giày Nike Court Royale AC là mẫu giày với thiết kế lấy cảm hứng từ thập niên 70 với những nét cổ điển mang phong cách đường phố đặc trưng. Đây là mẫu giày không bao giờ lỗi mốt, có thể sự dụng trong mọi nhu cầu đi lại hàng ngày.', 'Việt Nam', 3.00, 'Với chất liệu da cao cấp và đến cao su nguyên chất khiến đôi giày bền bỉ với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-06 15:11:59'),
(155, 'GIÀY LACOSTE CHAYMON 121', 2490000.00, 5, 'Giày Lacoste Chaymon 121  được thiết kế với phong cách cổ điển sang trọng đặc trưng của thương hiệu Lacoste. Các đường chỉ khâu thẳng hàng rất tinh tế và chắc chắn.', 'Việt Nam', 3.00, 'Phần đế giày được làm từ cao su lưu hóa được hãng Lacoste nghiên cứu và thử nghiệm mang lại độ bền và độ êm tuyệt đối cho đôi chân của bạn.\r\n\r\nGiày Lacoste Chaymon 121 Nam - Trắng là lựa chọn tuyệt vời cho bạn phong cách quý ông lịch lãm mà không kém phần trẻ trung, cá tính.', 10, '2024-05-06 14:43:59', '2024-05-12 08:47:51'),
(156, 'GIÀY LACOSTE COURT-DRIVE TRAINERS', 1590000.00, 5, 'Giày Lacoste Court-Drive Trainers là mẫu giày thể thao thời trang đa dụng của Lacoste. Đây là mẫu giày tuyệt vời dành cho các hoạt động thể thao hàng ngày như: Tập Gym, chạy bộ, đi bộ, đi chơi, đi làm...', 'Việt Nam', 5.00, 'Với công nghệ tiên tiến nhất của Lacoste hứa hẹn đây là mẫu giày không thể thiếu với các tín đồ của thương hiệu này.', 10, '2024-05-06 14:43:59', '2024-05-12 08:42:01'),
(157, 'GIÀY LACOSTE COURT-DRIVE TRAINERS', 1690000.00, 5, 'Giày Lacoste Court-Drive Trainers là mẫu giày thể thao thời trang đa dụng của Lacoste. Đây là mẫu giày tuyệt vời dành cho các hoạt động thể thao hàng ngày như: Tập Gym, chạy bộ, đi bộ, đi chơi, đi làm...', 'Việt Nam', 5.00, 'Với công nghệ tiên tiến nhất của Lacoste hứa hẹn đây là mẫu giày không thể thiếu với các tín đồ của thương hiệu này.', 10, '2024-05-06 14:43:59', '2024-05-12 08:47:07'),
(158, 'GIÀY LACOSTE CARNABY EVO BL1', 2390000.00, 5, 'Giày Lacoste Carnaby Evo BL 1 vẫn là thiết kể cổ điển của dòng Carnaby Evo sử dụng chất liệu da cao cấp mềm, hơn nữa không bị bí do đục lỗ ở 2 bên. Tỉ mỉ trong từng chi tiết cũng là đặc điểm nổi bật của dòng giày Lacoste.', 'Việt Nam', 3.00, 'Đế cao su đúc dày êm chân được gắn với phần upper bằng công nghệ ép nhiệt, có khâu đế xung quanh khiến đôi giày Lacoste Carnaby Evo BL 1 chắc chắn và bền hơn nữa. Màu xanh navy trung tính luôn được nhiều khách hàng lựa chọn bởi màu sắc dễ kết hợp trang phục. Bạn có thể vừa mặc đi làm đi chơi.', 10, '2024-05-06 14:43:59', '2024-05-12 08:33:22'),
(159, 'Giày mọi nam MWC NAMO- 6615', 2190000.00, 8, 'Sản phẩm hoàn hảo từ thiết kế, kiểu dáng cho tới chất liệu,chất da nguyên miếng nhập khẩu tạo nên vẻ bóng lì rất hút mắt và sang trọng, dập vân cách điệu thời trang, phối khóa nhỏ tinh tế\r\n\r\nThiết kế này rất \"dễ tính\" khi phối đồ,bạn có thể mix giày cùng trang phục trẻ trung như sơ mi dáng ôm và quần chinos có độ dài trên mắt cá chân,hay những bộ suit may đo lịch lãm cũng sẽ thêm phần hiện đại khi được phối cùng sản phẩm này.\r\n\r\nGiày mang vẻ đẹp đầy quyền uy mà vẫn thời thượng, hiện đại. Khi sử dụng, bạn sẽ cực kỳ tự tin với một đôi giày êm chân và không gây bức bí khó chịu.', 'Việt Nam', 3.00, 'Kiểu dáng : Giày tây\r\n\r\nChiều cao : 3cm\r\n\r\nChất liệu :  da PU cao cấp \r\n\r\nĐế : TPR êm mềm, độ đàn hồi tốt, chống trơn trượt', 10, '2024-05-06 14:43:59', '2024-05-20 01:19:12'),
(160, 'GIÀY LACOSTE CARNABY PRO CGR 2233', 2590000.00, 5, 'Giày Lacoste Carnaby Pro CGR 2233 là mẫu giày Lacoste mới có thiết kế cực đẹp, sang trọng và đẳng cấp đặc trưng của thương hiệu đến từ Pháp. Được làm từ chất liệu da cao cấp Lacoste Carnaby Pro CGR 2233 là lựa chọn tuyệt vời cho các quý ông.', 'Việt Nam', 4.00, 'Phần Upper của giày được là từ chất liệu da cao cấp, đẹp bền với thời gian. Phần đế được làm từ cao su chất lượng cao nhất, với khả năng chống chịu mài mòn rất tốt. Lacoste Carnaby Pro CGR 2233 có độ hoàn thiện hoàn hảo từng chi tiết.', 10, '2024-05-06 14:43:59', '2024-05-12 08:32:21'),
(161, 'GIÀY LACOSTE T-CLIP VELCRO 223', 2690000.00, 5, 'Giày Lacoste T-Clip Velcro 223 là mẫu giày thời trang của Lacoste lấy cảm hứng thì những năm 80 với thiết kế cổ điển, nhưng vẫn toát nên sang trọng đặc trưng của Lacoste.', 'Việt Nam', 5.00, 'Phần upper được làm từ chất liệu da cao cấp với những lỗ thoáng khí và dây Velcro hỗ trợ việc xở giày dễ dàng. Phần đế làm từ cao su chất lượng cao cho độ bám đường rất tốt. Giày được hoàn thiện chỉnh chu hoàn hảo từng chi tiết.', 10, '2024-05-06 14:43:59', '2024-05-12 08:40:43'),
(162, 'GIÀY LACOSTE LINESHOT 223', 2490000.00, 5, 'Giày Lacoste Lineshot 223 là mẫu giày thời trang của Lacoste lấy cảm hứng thì những năm 90 với thiết kế cổ điển, nhưng vẫn toát nên sang trọng đặc trưng của Lacoste.', 'Việt Nam', 5.00, 'Phần upper được làm từ chất liệu da cao cấp với những lỗ thoáng khí, phần mũi giày và phần gót chất liệu da lộn được phối rất tinh tế. Phần đế làm từ cao su chất lượng cao cho độ bám đường rất tốt. Giày được hoàn thiện chỉnh chu hoàn hảo từng chi tiết.', 10, '2024-05-06 14:43:59', '2024-05-12 08:39:48'),
(163, 'GIÀY LACOSTE POWERCOURT 2.0 223', 2590000.00, 5, 'Giày Lacoste PowerCourt 2.0 223 là mẫu giày thời trang của Lacoste có thiết kế đẹp, sang trọng và tinh tế. Chất liệu cao cấp kết hợp ăn ý giữa da trơn và da lộn mang đến sự độc đáo cho dòng sản phẩm này.', 'Việt Nam', 3.00, 'Phần upper được làm từ chất liệu da cao cấp với những lỗ thoáng khí và dây Velcro hỗ trợ việc xở giày dễ dàng. Phần đế làm từ cao su chất lượng cao cho độ bám đường rất tốt. Giày được hoàn thiện chỉnh chu hoàn hảo từng chi tiết.', 10, '2024-05-06 14:43:59', '2024-05-16 09:26:03'),
(164, 'GIÀY LACOSTE L001 223', 2690000.00, 5, 'Giày Lacoste L001 223 là một trong những mẫu giày HOT nhất của Lacoste hiện nay. Lacoste L001 223 có thiết kế cổ điển truyền thống của Lacoste nhưng lại có hơi hướng hiện đại rất hấp dẫn.', 'Việt Nam', 3.00, 'Giày Lacoste L001 223  được làm từ chất liệu da cực kỳ cao cấp của Lacoste, phần đế giày chất liệu cao su bền đẹp với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-12 08:36:23'),
(165, 'GIÀY LACOSTE L001 223', 2690000.00, 5, 'Giày Lacoste L001 223 là một trong những mẫu giày HOT nhất của Lacoste hiện nay. Lacoste L001 223 có thiết kế cổ điển truyền thống của Lacoste nhưng lại có hơi hướng hiện đại rất hấp dẫn.', 'Việt Nam', 5.00, 'Giày Lacoste L001 223  được làm từ chất liệu da trơn kết hợp da lộn cực kỳ cao cấp của Lacoste, phần đế giày chất liệu cao su bền đẹp với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-12 08:36:01'),
(166, 'GIÀY LACOSTE L001 223', 2690000.00, 5, 'Giày Lacoste L001 223 là một trong những mẫu giày HOT nhất của Lacoste hiện nay. Lacoste L001 223 có thiết kế cổ điển truyền thống của Lacoste nhưng lại có hơi hướng hiện đại rất hấp dẫn.', 'Việt Nam', 5.00, 'Giày Lacoste L001 223  được làm từ chất liệu da cực kỳ cao cấp của Lacoste, phần đế giày chất liệu cao su bền đẹp với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-12 08:42:48'),
(167, 'GIÀY LACOSTE POWERCOURT 2.0 223', 2390000.00, 5, 'Giày Lacoste PowerCourt 2.0 223 là mẫu giày thời trang của Lacoste có thiết kế đẹp, sang trọng và tinh tế. Chất liệu cao cấp kết hợp ăn ý giữa da trơn và da lộn mang đến sự độc đáo cho dòng sản phẩm này.', 'Việt Nam', 3.00, 'Giày Lacoste PowerCourt 2.0 223 được làm từ chất liệu da trơn kết hợp da lộn cực kỳ cao cấp của Lacoste, phần đế giày chất liệu cao su bền đẹp với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-12 08:42:20'),
(168, 'GIÀY LACOSTE CARNABY PRO BL23', 2350000.00, 5, 'Giày Lacoste Carnaby Pro BL23 là mẫu giày Lacoste mới có thiết kế cực đẹp, sang trọng và tinh tế đặc trưng của thương hiệu đến từ Pháp. Được làm từ chất liệu da cao cấp  Lacoste Carnaby Pro BL23 là lựa chọn tuyệt vời cho các quý ông.', 'Việt Nam', 3.00, 'Với đế cao su đúc dày êm chân được gắn với phần upper bằng công nghệ ép nhiệt, có khâu đế xung quanh khiến đôi giày chắc chắn và bền hơn nữa. Ngoài ra, Lacoste Carnaby Pro BL23 có phối màu vô cùng đẹp mắt.', 10, '2024-05-06 14:43:59', '2024-05-12 08:41:46'),
(169, 'GIÀY LACOSTE CARNABY PRO 2233', 2350000.00, 5, 'Giày Lacoste Carnaby Pro 2233 là mẫu giày Lacoste mới có thiết kế cực đẹp, sang trọng và tinh tế đặc trưng của thương hiệu đến từ Pháp. Được làm từ chất liệu da cao cấp  Lacoste Carnaby Pro BL23 là lựa chọn tuyệt vời cho các quý ông.', 'Việt Nam', 3.00, 'Với đế cao su đúc dày êm chân được gắn với phần upper bằng công nghệ ép nhiệt, có khâu đế xung quanh khiến đôi giày chắc chắn và bền hơn nữa. Ngoài ra, Lacoste Carnaby Pro 2233 có phối màu vô cùng đẹp mắt.', 10, '2024-05-06 14:43:59', '2024-05-12 08:31:40'),
(170, 'GIÀY LACOSTE POWERCOURT 223', 2490000.00, 5, 'Giày Lacoste PowerCourt 223 là mẫu giày thời trang của Lacoste có thiết kế đẹp, sang trọng và tinh tế. Chất liệu cao cấp kết hợp ăn ý giữa da trơn và da lộn mang đến sự độc đáo cho dòng sản phẩm này.', 'Việt Nam', 3.00, 'Với đế cao su đúc dày êm chân được gắn với phần upper bằng công nghệ ép nhiệt, có khâu đế xung quanh khiến đôi giày chắc chắn và bền hơn nữa. Ngoài ra, Lacoste PowerCourt 2233 có phối màu vô cùng đẹp mắt.', 10, '2024-05-06 14:43:59', '2024-05-12 08:34:38'),
(171, 'GIÀY LACOSTE TATALYA 119 SLIP ON', 1790000.00, 5, 'Giày Lacoste Tatalya 119 Slip On được thiết kế với phong cách đơn giản nhưng không kém phần lịch lãm đặc trưng của Lacoste. Kiểu dáng Slip On khiến cho đôi giày thật sự thuận tiện khi sử dụng.', 'Việt Nam', 3.00, 'Phần upper làm bằng da cao cấp, phần đế giày được làm từ cao su lưu hóa được hãng Lacoste nghiên cứu và thử nghiệm mang lại độ bền và độ êm tuyệt đối cho đôi chân của bạn.', 10, '2024-05-06 14:43:59', '2024-05-12 08:31:28'),
(172, 'GIÀY LACOSTE NIVOLOR 0721', 2360000.00, 5, 'Giày Lacoste Nivolor 0721 được thiết kế với phong cách sang trọng đặc trưng của thương hiệu đến từ nước Pháp. Phối màu đẳng cấp thật sự đẹp mắt, Lacoste Nivolor 0721 chắc chắn là lựa chọn xứng đáng dành cho bạn.', 'Việt Nam', 3.00, 'Phần upper làm bằng da cao cấp, phần đế giày được làm từ cao su lưu hóa được hãng Lacoste nghiên cứu và thử nghiệm mang lại độ bền và độ êm tuyệt đối cho đôi chân của bạn.', 10, '2024-05-06 14:43:59', '2024-05-12 08:37:57'),
(173, 'GIÀY LACOSTE GRAD VULC 120 2 P', 2090000.00, 5, 'Giày Lacoste Grad Vulc 120 có thiết kế đẹp các chi tiết vô cùng tỉ mỉ sắc sảo, cùng với chất liệu da cao cấp của Lacoste. Giày Lacoste Grad Vulc 120 chắc chắn là mẫu giày thời trang không thể bỏ qua trong năm nay.', 'Việt Nam', 3.00, 'Với công nghệ tiên tiến nhất của Lacoste hứa hẹn đây là mẫu giày không thể thiếu với các tín đồ của thương hiệu này.', 10, '2024-05-06 14:43:59', '2024-05-12 08:40:28'),
(174, 'GIÀY LACOSTE HYDEZ 119', 1190000.00, 5, 'Giày Lacoste Hydez 119 được thiết kế với phong cách cực kì hiện đại với chất liệu da thật cao cấp có độ bền độ bóng cao, không nhăn không thấm nước.', 'Việt Nam', 3.00, 'Phần đế giày được làm từ cao su lưu hóa được hãng Lacoste nghiên cứu và thử nghiệm mang lại độ bền và độ êm tuyệt đối cho đôi chân của bạn. Với màu xanh navy sang trọng, đây thực sự là mẫu giày thời trang đẳng cấp dành cho các đấng mày râu.', 10, '2024-05-06 14:43:59', '2024-05-12 08:48:05'),
(175, 'GIÀY LACOSTE HYDEZ 119', 2360000.00, 5, 'Giày Lacoste Hydez 119 được thiết kế với phong cách cực kì hiện đại với chất liệu da thật cao cấp có độ bền độ bóng cao, không nhăn không thấm nước.', 'Việt Nam', 3.00, 'Phần đế giày được làm từ cao su lưu hóa được hãng Lacoste nghiên cứu và thử nghiệm mang lại độ bền và độ êm tuyệt đối cho đôi chân của bạn. Với màu xanh navy sang trọng, đây thực sự là mẫu giày thời trang đẳng cấp dành cho các đấng mày râu.', 10, '2024-05-06 14:43:59', '2024-05-12 08:38:15'),
(176, 'GIÀY LACOSTE L001 123', 3100000.00, 5, 'Giày Lacoste L001 123 là một trong những mẫu giày HOT nhất của Lacoste hiện nay. Lacoste L001 123 có thiết kế cổ điển truyền thống của Lacoste nhưng lại có hơi hướng hiện đại rất hấp dẫn.', 'Việt Nam', 3.00, 'Giày Lacoste L001 123  được làm từ chất liệu da cực kỳ cao cấp của Lacoste, phần đế giày chất liệu cao su bền đẹp với thời gian.', 10, '2024-05-06 14:43:59', '2024-05-12 08:47:21');
